INSERT INTO `amenities` (`sno`, `amenities_name`, `description`, `image1`, `image2`, `image3`, `status`) VALUES
(1, 'Hostel', '<p>The college has provided a hostel for women which can accommodate 100 students. The hostel has basic amenities like reading room, TV room, internet facility, etc.Our College has provided hostel facility for girls in order to provide a secure atmosphere to girls. It is located in the campus. It has got good facilities and infrastructure which makes students feel comfortable and find a homely atmosphere. Being away from the city hubnubs, the hostel a serene and calm atmosphere.Detailed thought and consideration has gone in to provide utmost comfort to the students with more personal space provided in an ideal location. The students of all programmes live together in the hostels which helps in developing a healthy and cordial relationship among them. Ragging is strictly prohibited in the campus.The hostel has been providing the students with the following facilities:</p>', '2uscggh1qkqosw8gkk.jpg', '', '', 1),
(2, 'Transport', '<p>For the convenience of the students, The college operates a fleet of busses from the college to various localities in Karimnagar, ensuring their safety in commuting to college and back.</p>\n\n<p><strong><span style=\"font-size:16px\">College has Transportation Facilities from :</span></strong></p>\n\n<p><span style=\"font-size:14px\"><strong>1. Karimnagar Town</strong></span></p>\n\n<p><span style=\"font-size:14px\"><strong>2. Sircilla</strong></span></p>\n\n<p><span style=\"font-size:14px\"><strong>3. Vemulavada</strong></span></p>\n\n<p><span style=\"font-size:14px\"><strong>4. Jagitial</strong></span></p>\n\n<p><span style=\"font-size:14px\"><strong>5. Sulthanabad</strong></span></p>\n\n<p><span style=\"font-size:14px\"><strong>6. Peddapalli</strong></span></p>\n\n<p><span style=\"font-size:14px\"><strong>7. Jammikunta</strong></span></p>\n\n<p><span style=\"font-size:14px\"><strong>8. Choppadandi</strong></span></p>\n\n<p>&nbsp;</p>', 'k5oakopb0j4s0c4w0c.jpg', '', '', 1);
