(4, '6', 0x3167776f35347573373039773038677777732e706e67, '<h2><strong><span style=\"color:#FF0000\"><span style=\"font-family:times new roman,times,serif\">About Department</span></span></strong></h2>\n\n<p>Mechanical engineering is the discipline that applies engineering principles to design, analyze, manufacture, and maintain mechanical systems. It is one of the oldest engineering disciplines. There is great demand for skilled mechanical engineers in different segments of the industry. Their expertise is required in traditional manufacturing industries such as automobiles, aviation, shipping, aerospace, power plants and machinery manufacturing with the knowledge of core areas including mechanics, dynamics, thermodynamics, material science, structural analysis, computer-aided design and manufacturing, product life cycle management to design and analyze manufacturing plants, industrial equipment and machinery, heating and cooling systems, aircraft, watercraft, robotics, etc.</p>\n\n<p>It is the branch of engineering that involves the design, production, and operation of machinery. There is a great requirement for young mechanical engineers having management skills along with technical proficiency. The primary role of such professionals is to manage both technology and firms related to engineering stream.</p>\n\n<p>The job opportunities for skilled mechanical engineers are aplenty and unending. Mechanical engineers are required to design, test, manufacture, install, operate and maintain a wide array of machines and mechanical systems that are used in countless industries. These professionals can find employment both in the government and private sector undertakings.</p>\n\n<p>Mechanical department was established in 2012. The Department offers Diploma, Under Graduate programs. The department has well experienced faculty, good infrastructural facilities and has full-fledged laboratories equipped with adequate hardware and software technology. Mechanical engineering is a branch of engineering that involves the production, thermal, design, computer-aided design and manufacturing, operation of machine tools, hydraulic techniques.</p>\n\n<h2><span style=\"font-family:times new roman,times,serif\"><span style=\"font-size:14px\">Vision</span></span></h2>\n\n<p>To evolve as a center of excellence in establishment of global leadership quality in the mechanical engineering field to meet the global challenges..</p>\n\n<h2><span style=\"font-family:times new roman,times,serif\"><span style=\"font-size:14px\">Mission</span></span></h2>\n\n<p>&bull;To incorporate teaching and research for effective curriculum including of knowledge abilities and skills.</p>\n\n<p>&bull;To improve, enhance and engages the students in creating innovative solutions to meet industrialization needs.</p>\n\n<p>&bull;To promote quality and expertise students in an academic and professional pursuits.of education</p>\n\n<p>&bull;To establish multicultural and multi-disciplinary culture of hard work in leadership and development.</p>\n\n<p>&nbsp;</p>', 1),
(5, '8', 0x3977666d76796d396f316b776738386334772e706e67, '<p><span style=\"color:#FF0000\"><strong>About Department</strong></span></p>\n\n<p>The Department of Computer Applications was started in the year 2006. The Department offers MCA 2 Years (4 Semesters) with intake of 60. The course offered by the department focuses on preparing students for a global career in computing by enriching the curriculum with the blend of theory and practice. In this era of technological explosion, the department is dedicated to maintaining a high standard of excellence through quality, technology and innovation. The MCA program seeks to prepare students for high level careers in the ever expanding field of Computer Applications.</p>\n\n<p><span style=\"color:#FF0000\"><strong>Vision</strong></span></p>\n\n<p>To achieve professional excellence through high quality innovative teaching and training in computer applications for the development of students who can excel in the present future competitive profession according to the changing needs of the companies with high degree of integrity and ethical standards.The students with a good knowledge in computer applications are having opportunities which are almost endless in the IT industry. In this age of IT revolution, the MCA professionals can look forward for a bright future.</p>\n\n<p><span style=\"color:#FF0000\"><strong>Mission</strong></span></p>\n\n<p>To provide high quality education in the field of computer applications and there by create computer professionals with proper leadership skills, commitment and moral values. Encourage faculty to have continuous progress in their teaching skills and self-development.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"color:#FF0000\"><strong>PROGRAM SPECIFIC OUTCOMES (PSOs)</strong></span></p>\n\n<p>&nbsp;</p>\n\n<p><strong>PSO1:</strong>&nbsp;Apply mathematical and scientific skills in numerous areas of Computer Applications to design and develop software-based systems.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>PSO2:&nbsp;</strong>Acquaint module knowledge on emerging trends of the modern era in Computer Applications</p>\n\n<p>&nbsp;</p>\n\n<p><strong>PSO3:</strong>&nbsp;Promote novel applications that meet the needs of entrepreneur, environmental and social issues.</p>\n\n<p>&nbsp;</p>', 1),
(2, '4', 0x377235686d613730616d73633434386734632e6a7067, '<p><span style=\"color:#FF0000\"><strong>ELECTRONICS&nbsp; AND COMMUNICATION ENGINEERING:</strong></span></p>\n\n<p>The Department of Electronics and Communication Engineering was established in the year of 2005. With excellent laboratory facilities and dedicated faculty, the department offers an Under Graduate program (B.Tech) in Electronics and Communication Engineering with an intake of 150 students. The department successfully running post graduate programs M.Tech (VLSI and Embedded Systems) with an intake of 18 and M.Tech (ECE) with an intake of 18. The Department&rsquo;s main objective is not only make the students excel in theory but also in experimental research through academic projects in various fields. The Department regularly organizes several programs such as workshops, guest lectures, seminars etc. to impart state of art knowledge in different technologies to the students as well as faculty members</p>\n\n<p>Department is dedicated to advancing, disseminating and exploiting knowledge in engineering and technology. The department offers a four-year course a Bachelor&#39;s degree in Electronics and Communications Engineering. Department has the most advanced art of advanced equipment in the laboratory. A team of dedicated, always highly qualified faculty members to share experiences with emerging young engineers. Faculty members work in departments, and they support students and students like the family, creating a very favorable atmosphere for student development. All employees can reach students for any of their problems, whether academic or non-academic. The department aims to technically develop students and make them mentally strong to meet future challenges.</p>\n\n<p>The department also seeks to provide its students with excellent educational and educational opportunities in the field of electronics and communications engineering, thus providing a lasting technical basis in an environment of rapid technical change. In the process, it enables and promotes their professional growth through contact with best professional practices. Consequently, the administration is trying to play the role of resources and technical leadership in development activities at the national level.</p>\n\n<p><span style=\"color:#FF0000\"><strong>VISION:</strong></span></p>\n\n<p><strong><img alt=\"\" src=\"vgsek.ac.in/vission.jpg\" /></strong>To emerge as a leading centre for students and faculty in their pursuits of professional excellence in the fields of Electronics and Communication Engineering by making use of current Scientific and Technological advancements, with focus on human values, professional ethics and social responsibility</p>\n\n<p><span style=\"color:#FF0000\"><strong>MISSION:</strong></span></p>\n\n<p><img alt=\"\" src=\"http://vgsek.ac.in/mission1.jpg\" />* Training students in the basic core and application oriented subjects of Electronics and Communication engineering with due focus on multi disciplinary areas.</p>\n\n<p>* Establishing liaison with relevant industries, R&amp;D organizations and renowned academia for exposure to practical R&amp;D aspects of technology.</p>\n\n<p>* Inculcating team work, leadership, professional ethics and other skills such as effective communication, logical reasoning, career goal setting, liberal use of modern tools, and familiarity with IPR to make students globally competent in employment as well as entrepreneurship.</p>\n\n<p>* Promoting scientific temper and research culture in the graduates towards lifelong learning to produce useful research outcomes.</p>', 1),
(3, '5', 0x706b6e67353639783173307767347334302e706e67, '<h3><strong><span style=\"color:#FF0000\">About Department</span></strong></h3>\n\n<p>Electrical &amp; Electronics Engineering started in 2005. The Department is bestowed with highly qualified and experienced faculty out of which 2 have completed their Ph.D. The Department offers UG programme in EEE (two sections) with an objective of imparting quality education in the Electrical and Electronics Engineering and one PG programme in Power Electronics. The Department has 11 well equipped labs with latest simulation &amp; design software. The Department is enriched with PE, PS Labs and R&amp;D. The Department initiated power Club in 2005.</p>\n\n<p>EEE is the oldest of the engineering streams, and its applications are many. vaageswari provides this important course for the undergraduates, and there are many benefits in joining it.</p>\n\n<p>The faculty strives to foster and encourage a teaching methodology that is both practical and theoretical in approach tuning to the requirements of the latest developments in research and industry in the field of Electrical and Electronics Engineering.</p>\n\n<p>The department has well established laboratories with sophisticated equipment supplementing the academic needs of the students. The lab facilities are being upgraded from time to time, to provide adequate opportunities for the students to learn and innovate.</p>\n\n<p>The department is actively engaged in research. The efforts are directed towards reorienting the laboratories to establish close relation with industry. The department has been organizing short term training programs, seminars, workshops, guest lectures by experts, technical &amp; non-technical student fests regularly. The department is working for the improvement of Industry &ndash; Institute Interaction in terms of academics &amp; research and also for the development of infrastructure to match the needs of the industry. The department is striving hard to attain &amp; sustain as a centre of excellence in Electrical engineering education &amp; research with a holistic approach.</p>\n\n<p>Educational tours and industrial visits are regularly organized to enhance the practical knowledge of the students and to keep them abreast with the latest technological applications in various industries so that their employability skills are enhanced.</p>\n\n<p>The Department has an Exclusive Library of various text books for quick reference .It is equipped with a number of volumes of books in subjects like Power Systems Engg.,Electrical Basic Circuits and Network Analysis, Electrical Machines, Power Electronics, Control Engg., and Electronic Engg. It is also equipped with some volumes on advanced subjects like Digital Signal Processing and Digital Image Processing. It also has books related to Quantitative Aptitude which will be helpful to students during campus placements. The number of career prospects for this group is huge, and it is the reason for many people to join this course. These students are offered with high salaried jobs, especially in the public sector. They are needed in power industry, electrical machine industries, etc. A number of private companies also offer lucrative job roles for these engineers. Due to this requirement, Vaageswari gives a special preference to EEE, and we had built a special base for this group. EEE is one of the core streams of engineering, and it is required in any case. Hence the demand for this group never decreases, and it is the steadiest stream ever</p>\n\n<p>Alumni Chapter is in existence and regularly interacting with them to get feedback with regard to academic, placements etc. matters. Their suggestions are taken into consideration in various developmental activities of the department. Many of our alumni are pursuing their higher studies in IITs and reputed universities, abroad. More than 70% of the eligible students are being placed in reputed companies in every year.</p>\n\n<h3><span style=\"color:#FF0000\"><strong>Vision</strong></span></h3>\n\n<p>Excellence in quality education by keeping pace with the rapidly changing technologies and to create a highly innovative and research oriented man power meeting the global standards in the field of Electrical and Electronics Engineering</p>\n\n<h3><span style=\"color:#FF0000\"><strong>Mission</strong></span></h3>\n\n<p>To create an excellent academic environment where a strong theoretical knowledge and practical skills can be imparted. Further, the graduates will also be trained in interpersonal communication skills and teamwork along with an emphasis on ethics and morals for the sustainable development of the society.</p>\n\n<p>&nbsp;</p>', 1),
(6, '3', 0x37356568726f7a7161796777676f346f342e6a7067, '<p><span style=\"color:#FF0000\"><span style=\"font-size:14px\"><strong>About Department</strong></span></span></p>\n\n<p>The Department of Computer Science and Engineering was established in the year 2005. with an intake of 60 students in B.Tech. it has become one of the most strongest and dynamic departments in the college and the computer science field with the distinguished and committed faculty members. The Computer Science and Engineering (CSE) department is dedicated in imparting quality education through well-designed and periodically upgraded curriculum in tune with the challenging software needs of the industry.</p>\n\n<p>The intake currently is 180 in B.Tech. (CSE) Programme. The department is also successfully running post graduate programme M. Tech. (Computer Science and Engineering) with an intake of 36. There are eighteen Computer Laboratories in the department well and figured computer systems. The computer laboratories are equipped with state of the art facilities meeting the standards and well maintained by dedicated and competent teaching and non-teaching staff.</p>\n\n<p>Computer Science and Engineering department is now home to several eminent and new faculty members, having rich experience in academics, industry and R&amp;D. The department has grown to good number of faculty members who provide leadership and expertise in several areas of computer science and engineering.</p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"color:#FF0000\"><strong>Vision</strong></span></p>\n\n<p>To acknowledge quality education and instill high patterns of discipline making the students technologically superior and ethically strong which involves the improvement in the quality of life in human race.</p>\n\n<p><br />\n<span style=\"color:#FF0000\"><strong>Mission</strong></span></p>\n\n<p>&bull; To prepare Computer Science and Engineering graduates to be a lifelong learner with competence in basic science &amp; engineering and professional core, multidisciplinary areas, with continuous update of the syllabus, so that they can succeed in industry as an individual and as a team or to pursue higher studies or to become an entrepreneur.</p>\n\n<p>&bull; To enable the graduates to use modern tools, design and create novelty based products required for the society and communicate effectively with professional ethics.</p>\n\n<p>&bull; To achieve and impart holistic technical education using the best of infrastructure, outstanding technical and teaching expertise to establish the students into competent and confident engineers</p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"color:#FF0000\"><strong>B.Tech (CSE)</strong></span></p>\n\n<table align=\"left\" border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:720px\">\n	<tbody>\n		<tr>\n			<td style=\"height:34px; width:57px\">\n			<p><span style=\"color:#0000FF\"><strong>PO#</strong></span></p>\n			</td>\n			<td style=\"height:34px; width:130px\">\n			<p><span style=\"color:#0000FF\"><strong>Graduate Attributes</strong></span></p>\n			</td>\n			<td style=\"height:34px; width:533px\">\n			<p><span style=\"color:#0000FF\"><strong>PO Statements</strong></span></p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:64px; width:57px\">\n			<p><strong>PO 1</strong></p>\n			</td>\n			<td style=\"height:64px; width:130px\">\n			<p><strong>Engineering knowledge</strong></p>\n			</td>\n			<td style=\"height:64px; width:533px\">\n			<p>Apply the knowledge of mathematics, science, engineering fundamentals, and an engineering specialization to the solution of complex engineering problems.</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:64px; width:57px\">\n			<p><strong>PO 2</strong></p>\n			</td>\n			<td style=\"height:64px; width:130px\">\n			<p><strong>Problem analysis</strong></p>\n			</td>\n			<td style=\"height:64px; width:533px\">\n			<p>Identify, formulate, review research literature, and analyze&nbsp; complex&nbsp; engineering problems reaching substantiated conclusions using first principles of mathematics, natural sciences, and engineering sciences</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:82px; width:57px\">\n			<p><strong>PO 3</strong></p>\n			</td>\n			<td style=\"height:82px; width:130px\">\n			<p><strong>Design/ development of solutions</strong></p>\n			</td>\n			<td style=\"height:82px; width:533px\">\n			<p>Design solutions for complex engineering problems and design system components or processes that meet the specified needs with appropriate consideration for the public health and safety, and the cultural, societal, and environmental considerations.</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:64px; width:57px\">\n			<p><strong>PO 4</strong></p>\n			</td>\n			<td style=\"height:64px; width:130px\">\n			<p><strong>Conduct investigations of complex problems</strong></p>\n			</td>\n			<td style=\"height:64px; width:533px\">\n			<p>Use research-based knowledge and research methods including design of experiments, analysis and interpretation of data, and synthesis of the information to provide valid conclusions.</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:64px; width:57px\">\n			<p><strong>PO 5</strong></p>\n			</td>\n			<td style=\"height:64px; width:130px\">\n			<p><strong>Modern tool usage</strong></p>\n			</td>\n			<td style=\"height:64px; width:533px\">\n			<p>Create, select, and apply appropriate techniques, resources, and modern engineering and IT tools including prediction and modelling to complex engineering activities with an understanding of the limitations.</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:64px; width:57px\">\n			<p><strong>PO 6</strong></p>\n			</td>\n			<td style=\"height:64px; width:130px\">\n			<p><strong>The engineer and society</strong></p>\n			</td>\n			<td style=\"height:64px; width:533px\">\n			<p>Apply reasoning informed by the contextual knowledge to assess societal, health, safety, legal and cultural issues and the consequent responsibilities relevant to the professional engineering practice.</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:64px; width:57px\">\n			<p><strong>PO 7</strong></p>\n			</td>\n			<td style=\"height:64px; width:130px\">\n			<p><strong>Environment and sustainability</strong></p>\n			</td>\n			<td style=\"height:64px; width:533px\">\n			<p>Understand the impact of the professional engineering solutions in societal and environmental contexts, and demonstrate the knowledge of, and need for&nbsp; sustainable development.&nbsp;</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:61px; width:57px\">\n			<p><strong>PO 8</strong></p>\n			</td>\n			<td style=\"height:61px; width:130px\">\n			<p><strong>Ethics</strong></p>\n			</td>\n			<td style=\"height:61px; width:533px\">\n			<p>Apply ethical principles and commit to professional ethics and responsibilities and norms of the engineering practice.</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:47px; width:57px\">\n			<p><strong>PO 9</strong></p>\n			</td>\n			<td style=\"height:47px; width:130px\">\n			<p><strong>Individual and team work</strong></p>\n			</td>\n			<td style=\"height:47px; width:533px\">\n			<p>Function effectively as an individual, and as a member or leader in diverse teams, and in multidisciplinary settings.</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:76px; width:57px\">\n			<p><strong>PO 10</strong></p>\n			</td>\n			<td style=\"height:76px; width:130px\">\n			<p><strong>Communication</strong></p>\n			</td>\n			<td style=\"height:76px; width:533px\">\n			<p>Communicate effectively on complex engineering activities with the engineering community and with society at large, such as, being able to comprehend and write effective reports and design documentation, make effective presentations, and give and receive clear instructions.</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:64px; width:57px\">\n			<p><strong>PO 11</strong></p>\n			</td>\n			<td style=\"height:64px; width:130px\">\n			<p><strong>Project management and finance</strong></p>\n			</td>\n			<td style=\"height:64px; width:533px\">\n			<p>Demonstrate knowledge and understanding of the engineering and management principles and apply these to one&rsquo;s own work, as a member and leader in a team, to manage projects and in multidisciplinary environments.</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:65px; width:57px\">\n			<p><strong>PO 12</strong></p>\n			</td>\n			<td style=\"height:65px; width:130px\">\n			<p><strong>Life-long learning</strong></p>\n			</td>\n			<td style=\"height:65px; width:533px\">\n			<p>Recognize the need for, and have the preparation and ability to engage in independent and life-long learning in the broadest context of technological change.</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"color:#FF0000\"><strong>B.TECH Program Educational Objectives(PEO&rsquo;s)</strong></span></p>\n\n<table border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:678px\">\n	<tbody>\n		<tr>\n			<td style=\"height:28px; width:64px\">\n			<p><span style=\"color:#0000FF\"><strong>Sl.No.</strong></span></p>\n			</td>\n			<td style=\"height:28px; width:110px\">\n			<p><span style=\"color:#0000FF\"><strong>PEO#</strong></span></p>\n			</td>\n			<td style=\"height:28px; width:504px\">\n			<p><span style=\"color:#0000FF\"><strong>Program Educational Objectives</strong></span></p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:73px; width:64px\">\n			<p><strong>1</strong></p>\n			</td>\n			<td style=\"height:73px; width:110px\">\n			<p><strong>PEO - 1</strong></p>\n			</td>\n			<td style=\"height:73px; width:504px\">\n			<p>To promote industrial growth and social transformation students must practice their profession with ethics and produce responsible graduates within them</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:73px; width:64px\">\n			<p><strong>2</strong></p>\n			</td>\n			<td style=\"height:73px; width:110px\">\n			<p><strong>PEO &ndash; 2</strong></p>\n			</td>\n			<td style=\"height:73px; width:504px\">\n			<p>Apply fundamental knowledge for problem analysis and conduct computer science and engineering research for continual progress</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:66px; width:64px\">\n			<p><strong>3</strong></p>\n			</td>\n			<td style=\"height:66px; width:110px\">\n			<p><strong>PEO &ndash; 3</strong></p>\n			</td>\n			<td style=\"height:66px; width:504px\">\n			<p>To adapt to a fast changing environment through acquisition and applications of skills and technologies illustrated by students using their abilities</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"color:#FF0000\"><strong>B.TECH&nbsp;Program Specific Outcomes</strong></span></p>\n\n<table border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:684px\">\n	<tbody>\n		<tr>\n			<td style=\"height:30px; width:124px\">\n			<p><span style=\"color:#0000FF\"><strong>&nbsp; &nbsp;PSO#</strong></span></p>\n			</td>\n			<td style=\"height:30px; width:560px\">\n			<p><span style=\"color:#0000FF\"><strong>&nbsp; &nbsp;Program Specific Outcomes</strong></span></p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:69px; width:124px\">\n			<p><strong>PSO - 1</strong></p>\n			</td>\n			<td style=\"height:69px; width:560px\">\n			<p>The students must design and develop the solutions using the latest software for the objective of task execution in a particular domain.</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:77px; width:124px\">\n			<p><strong>PSO &ndash; 2</strong></p>\n			</td>\n			<td style=\"height:77px; width:560px\">\n			<p>Utilize computer science and Information Technology Techniques for industrial application in independent systems like cloud computing , Artificial intelligence, natural language processing, computer vision&nbsp; and emerging areas</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p><br />\n&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>', 1),
(9, '11', 0x616a6a70393767616866733473736b30302e6a7067, '<p><strong><span style=\"color:#FF0000\">About Department</span></strong></p>\n\n<p><br />\nDepartment of Chemistry at Vaageswari college of Engineering has been offering First year B.Tech Program right from its inception with excellent laboratory facilities. It is a part of Humanities and Sciences Department. The Chemistry department serves the purpose of imparting knowledge in the core science subject, along with innovative ideas to achieve their goals keeping concern about the present environmental needs which is a fundamental building block for most engineering disciplines. The department has highly qualified faculty who have knowledge in research and vast experience in the teaching field. The faculty has contributed many research papers which are published in distinguished international and national journals.</p>\n\n<p><br />\n<span style=\"color:#FF0000\"><strong>VISSION&nbsp;</strong></span></p>\n\n<p>Our Vision is to provide the opportunity for students to develop their knowledge and skills in engineering chemistry. The extent to which these skills will be developed depends on the needs of the students in the various categories.</p>\n\n<div class=\"row\" style=\"box-sizing: border-box; margin-left: -15px; margin-right: -15px; color: rgb(96, 96, 96); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px;\">\n<div class=\"col-md-12\" style=\"box-sizing: border-box; position: relative; min-height: 1px; padding-left: 15px; padding-right: 15px; float: left; width: 900px;\">\n<p><span style=\"color:#FF0000\"><strong>MISSION</strong></span></p>\n\n<p>* To build bridge gap between intermediate and B.Tech</p>\n\n<p>* To impart value based technical education so that the next generation engineers who serve society well get produced.</p>\n\n<p>* To develop confidence levels of student on B.Tech course of their respective discipline</p>\n</div>\n</div>\n\n<p>&nbsp;</p>', 1),
(10, '10', 0x7631627031616869697367676334776b73672e6a7067, '<p><span style=\"color:#FF0000\"><strong>About Department</strong></span></p>\n\n<p><strong>Vission</strong><br />\n&bull; To build a foundation for excellence and encourage the development of the institution as a premier institution by igniting and promoting enthusiasm, interests and passion, in the study of physics, in professional courses as the part of curriculum.</p>\n\n<p><strong>Mission</strong><br />\n&bull; To awaken the young minds and discover their talents both in theory and in practical physics through dedication to teach, commitment towards students and innovate instructional methods like PPT &amp; visual aids</p>\n\n<p>&bull; To support the developmental activities of the college and make the department vibrant.</p>\n\n<p>&bull; To make vital contributions in areas such as faculty, modern labs, and demonstrate a high level of competence in the study of Engineering Physics / Applied Physics.</p>\n\n<p>&bull; To organize and sustain efficient operating methods in the department for realization of our objectives as Institution of eminence.</p>\n\n<p>&bull; To develop a strategy in the department for continuous improvement.</p>\n\n<p>On behalf of Management, all our faculty, staff and students, I would like to welcome you to the Physics Department at Vaageswari College of Engineering. Our primary goal at the Department of Physics for Newcomers Engineering is to prepare dynamic professionals for innovation and to awaken their hidden talents in basic sciences, leadership qualities with the resources required to be successful during the first year of engineering on the campus. The department is well-equipped with laboratory facilities for Applied Physics and Engineering Physics subjects and supported by well qualified, highly dedicated faculty with utmost level of proficiency. The college provides a variety of required activities to the students that leads to grooming, holistic development and helps in the successful completion of their graduation with enthusiasm and passion.</p>', 1),
(8, '7', 0x327379666f7a71337677697363346b7330672e6a7067, '<p><span style=\"color:#FF0000\"><strong><span style=\"font-size:16px\">About Department</span></strong></span></p>\n\n<p>The Department of Business management is a leading business management school in North Telangana offering High-class education through a student-focused culture of excellence, entrepreneurial thinking and industry alignment. As a part of offering Technical and professional courses, in order to meet the increasing demands from national and international enterprises for efficient managers, in the recent times, Vaageswari College of Engineering, has started the Department of Business Management (MBA) in the year 2006 with an intake of 60 students. Till the date 720 students were graduated from the department.<br />\nA high quality expertise team of faculty is appointed to teach students. The team of MBA faculty is highly talented and they can explain the complicated concepts in a very simple manner, so that the students understand and memorize well.<br />\nSpecializations in the areas of Finance, Marketing and Human Resource Management are offered, which are essential for any sector, with an aim to develop students&rsquo; knowledge in domain area and improve the business strategies and then they able to engage their business or take up a responsible position in other corporate companies.<br />\nTo enhance soft skills and life skills to our students, we organize various skill development programs, which offer them a realistic experience; they are familiarized with the role they have to play, to handle the tough situation in the future. The department has separate and well equipped library and business lab facilities. We have secured 90 per cent of result this year.</p>\n\n<p><span style=\"color:#FF0000\"><strong>Vission:</strong></span><br />\nTo become a top management institute recognized nationally for its excellence in creation of an excellent intellectual capital of high thinking management professionals, entrepreneurs and socially responsible citizens.</p>\n\n<p><span style=\"color:#FF0000\"><strong>Mission:</strong></span><br />\n&bull; To nurture the future business managers/leaders through imparting high quality value-based teaching, research and practical based training that meets industry expectations.</p>\n\n<p>&bull; To foster a passion for learning and creative thinking among the student and teaching community.</p>\n\n<p>&bull; To prepare management professionals&rsquo; mindset having high professional competence, outstanding leadership qualities and flawless personal integrity.</p>', 1),
(12, '9', 0x316e35716e62646d6a363977636f636763672e6a7067, '<p><span style=\"color:#FF0000\"><strong>English Department</strong></span></p>\n\n<p>Department Mission<br />\n&ldquo;To nurture the upcoming young professionals to face the dynamic situation of the corporate and business world by training the students in communication skills, soft skills, mentoring and counselling&rdquo;</p>', 1),
(14, '2', 0x68326b616a32333878317773676b6f6f302e706e67, '<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\"><span style=\"color:#FF0000\"><strong>About the Department</strong></span></div>\n\n<p>Welcome to the Department of Computer Science and Engineering (Artificial Intelligence &amp; Machine Learning) at Vaageswari College of Engineering, Karimnagar new approach to education that fosters innovation, creativity, and employability covering core computer science topics and essential courses for AI and ML.</p>\n\n<p>Artificial intelligence is a bigger concept to construct intelligent machines that can replicate and act on human cognitive skills and actions whereas Machine learning is an application of artificial intelligence that enables machines to learn from data without being explicitly programmed. Students who want to develop top-tier knowledge in artificial intelligence, machine learning, and emerging technologies that will help them advance their professions in the approaching technological era are best suited for this course.</p>\n\n<p>The Department has a well-qualified teaching faculty with extensive research, teaching, and industrial experience, and it is committed to provide rigorous training to students in order to generate knowledge using cutting-edge AI&amp;ML concepts and technologies, and to transform the Department into a leader in AI&amp;ML education and research.</p>\n\n<p>From its inception, the department has practiced Outcome-Based Education (OBE), with an adequate infrastructure, state-of-the-art laboratories and other supporting resources to create an enhanced learning environment.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\"><span style=\"color:#FF0000\"><strong>Vision</strong></span></div>\n\n<p>To develop qualified AI and machine learning specialists who will contribute globally to the benefit of industry and society.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\"><span style=\"color:#FF0000\"><strong>Mission</strong></span></div>\n\n<ul>\n	<li>To train experts in Artificial Intelligence and Machine Learning..</li>\n	<li>To Provide rigorous training to develop knowledge using cutting-edge concepts and technology in Artificial Intelligence and Machine Learning..</li>\n	<li>To Establish centers of excellence in key areas of computers and artificial intelligence and to instill in young minds strong ethical principles, innovative research capabilities and leadership qualities to work with a commitment.</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>', 1),
(11, '12', 0x3163636f6e6a33363238797334676f63636f2e6a7067, '<p><span style=\"color:#FF0000\"><strong>About Department:</strong></span><br />\nThe Department Of Mathematics was established in the year 2005 and has always shared the vision of the institute in striving for excellence in teaching and learning activities Mathematics is an indispensable subject in the study of Science and Technology. The importance of Mathematics in engineering is known to everybody without having a sound knowledge of Mathematics, it is not possible to become a good engineer or any discipline. The Department of Mathematics strives to instil a conceptual understanding of the subject which would go along was in the study of their respective branches of engineering.</p>\n\n<p><br />\n<strong><span style=\"color:#FF0000\">VISION:</span></strong><br />\nTo centre stage Mathematical knowledge in the curriculum, instill analytical and logical thinking among students and promote Mathematical thoughts as an important area of human thoughts.<br />\nTo encourage students to conduct student projects to develop their analytical and logical thinking</p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"color:#FF0000\"><strong>MISSION:</strong></span></p>\n\n<p>To impart to students an in-depth knowledge of mathematics and its applications in various fields of engineering so as to enable them to meet the challenges of the world with courage, confidence, conviction and competence.</p>', 1),
(13, '2', '', '<h3>About Department</h3>\n\n<p>The Department of Computer Science and Engineering(Artificial Intelligence &amp; Machine Learning) was established in the year of 2020,with excellent laboratory facilities and dedicated facultywith an annual intake of 120 students. The Department&rsquo;s main objective is not only make the students excel in theory but also in experimental research through academic projects in various fields.</p>\n\n<p>Artificial intelligence and Machine Learning will impact all segments of daily life by 2025, with applications in a wide range of industries such as healthcare, transportation, insurance, transport and logistics, and customer service. A role in this domain places you on the path to an exciting, evolving career that is predicted to grow sharply into 2025 and beyond.</p>', 1),
(15, '1', 0x756178306e39626f3137343877736b7738772e6a7067, '<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\"><span style=\"color:#FF0000\"><strong>ABOUT DEPARTMENT:</strong></span></div>\n\n<p>The Department of Civil Engineering at Vaageswari College of Engineering is has been producing high-quality technical manpower needed to industry, R&amp;D organizations, and academic institutions since 2013, with an Intake of 60. The intake has been increased to 120 in the year 2014.</p>\n\n<p>Under academic activity, more emphasis is bestowed on deep comprehension and understanding of fundamental principles of each subject in all cognitive teaching learning methodologies. The department has full-fledged Surveying laboratory, AutoCAD, GIS laboratory, Engineering Geology laboratory, Strength of materials laboratory, Hydraulic and Hydraulics machinery laboratory, Soil Mechanics laboratory, Concrete Technology laboratory, Environmental Engineering laboratory, Transportation Engineering laboratory.</p>\n\n<p>Many of our students are placed in reputed companies like GMR, L&amp;T, Aparna infrastructures, NCC, Navayuga, GVK, Lanco Infratech limited, IVRCL infrastructures &amp; projects ltd, Indian army, Indian navy and many more. The academic activities of the department emphasize deep understanding of fundamental principles, development of creative ability to handle the challenge of civil engineering, and the analytical ability to solve problems which are interdisciplinary in nature. The department is actively involved in basic and applied research and consultancy.</p>\n\n<p>Department also provides technical guidelines for the benefits of students and entrepreneurs by organizing short-term courses, certificate oriented training programs like Auto-cad, Stadd.pro, and Primavera,Revit,MEP etc., under finishing school concept, seminars, academic/industrial guest lectures, national level workshops, national and international conferences.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\"><span style=\"color:#FF0000\"><u><strong>Vision</strong></u></span></div>\n\n<p>To Impart Knowledge and Excellence in Civil Engineering and Technology with Technical Competencies to meet the Current and Future Challenges.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\"><span style=\"color:#FF0000\"><u><strong>Mission</strong></u></span></div>\n\n<p>To provide state of the art infrastructure and resources that contributes to a congenial learning<br />\nenvironment for students.</p>\n\n<p>To make the department a centre of excellence in the field of Civil Engineering and allied research.</p>\n\n<p>To promote innovative and original thinking in the minds of budding engineers to face the challenges of the future.</p>\n\n<p>To produce Civil Engineers of high caliber, technical skills and ethical values to serve the society and nation.</p>\n\n<p>To Accomplish the Mission:<br />\n1. An exceptional curriculum including in depth coverage in technical sub-disciplines of the department.</p>\n\n<p>2. Engages the students in creating innovative design solutions that include realistic constraints such as economic, environmental,social,health &amp; safety.</p>\n\n<p>3. To train the students in a manner that they can pursue higher studies so that they can contribute to the teaching profession and development of civil engineering and other allied fields.</p>\n\n<p>4. The multicultural and multi-disciplinary groups for sustainable development and growth.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\"><strong><span style=\"color:#FF0000\">OBJECTIVES:</span></strong></div>\n\n<p><br />\n1) To make the students useful for Building Industry directly after completing Civil Engineering course.</p>\n\n<p>2) To Prepare and Develop Excellent and System of Power Point Projection to use in teaching activity.</p>\n\n<p>3) To prepare working models in the subject Hydraulic Machines by using prospective and transparent PVC, plastic sheets.</p>\n\n<p>4) To develop Geology Lab by collecting valuable minerals and rocks, and displaying all the available minerals in a show-case, to create a show room for the lab.</p>\n\n<p>5) To train the faculty on latest technologies and improve their teaching methodologies.</p>\n\n<p>6) To establish a platform where the industry and institution can interact and thereby expose the students to the industry environment.</p>\n\n<p>7) To establish a center of excellence in the areas of Consultancy Work and Research in Construction Field.</p>', 1),
(16, '13', 0x34357a6a326a77376a646b3477636773342e6a7067, '<p style=\"text-align:justify\">The department of Civil Engineering in Vaageswari College of Engineering II shift polytechnic was established in the year 2014 with intake of 60 students and Faculty strength. The main focus of the department is to produce polytechnic students with Strong fundamentals in Civil Engineering. Well equipped Laboratories/Workshops/Library, Dedicated and motivated faculty, special coaching classes for weak students, Focus on communication skills and soft skills to improve the personal skills of students</p>\n\n<p>VISION &amp; MISSION</p>\n\n<p><img src=\"https://vgsek.ac.in/images/diplomaimages/civilImages/civil%20engg.jpg\" style=\"background-color:rgb(255, 255, 255); color:rgb(51, 51, 51); cursor:default; font-family:sans-serif,arial,verdana,trebuchet ms; font-size:13px\" /></p>\n\n<p>Vision<br />\nTo impart quality education, to create professional engineers with basics in engineering field using technical skills and values.</p>\n\n<p><br />\nMission<br />\nTo enable industry research to develop into outstanding infrastructure, products and professionals with high ethical standards to face the challenges of the next millennium. To fulfill the experience of the society by equipping industries employee to stride forth resourceful citizens who are aware of their immense responsibilities to make the world a better place.</p>\n\n<p><br />\nProspects<br />\nCivil Engineering is one of the core branches of engineering. It is the second oldest engineering branch. It is an engineering discipline that focuses on design, planning, construction and maintenance of physically built as well as natural environment. The work of a civil engineer involves lots of drawing, sketching, planning, site work, material and human resource management, cost estimation, project planning and management, data collection and analysis, site supervision and finance management. Finally it is a very easy way to get Employment in Private sector as site engineer, planner, designer etc. &amp; in government sector as Assistant engineer, Town planning officer, deputy surveyor etc</p>', 1),
(18, '15', 0x3175666a6b7a767a3172793834386f6f38382e6a7067, '<p><br />\nAbout the Department:<br />\nThe department of Electrical &amp; Electronics Engineering in Vaageswari College of Engineering 2nd shift polytechnic was established in the year 2013 with in take of 60 students and Faculty strength.</p>\n\n<p>The main focus of the department is to produce polytechnic students with Strong fundamentals in Electrical &amp; Electronics Engineering. Well equipped Laboratories/Workshops/Library, Dedicated and motivated faculty, special coaching classes for weak students, Focus on communication skills and soft skills to improve the personal skills of students</p>\n\n<p><br />\nVISION &amp; MISSION</p>\n\n<p><img alt=\"\" src=\"https://vgsek.ac.in/images/diplomaimages/eeeImages/aa.png\" /></p>\n\n<p>VISION<br />\nTo Produce a competent Diploma Engineers who are employable with relevant skills to take up gainful employment in the existing and emerging Industries at the local and global level and to impart technical knowledge and skills required to succeed in life, career and to help society to achieve self-sufficiency.</p>\n\n<p><br />\nMission<br />\nTo become an internationally leading department for higher learning. To build upon the culture and values of universal science and contemporary education. To be a center of research and education generating knowledge and technologies which lay ground work in shaping the future in the fields of electrical and electronics engineering. To develop partnership with industrial, R&amp;D and government agencies and actively participate in conferences, technical and community activities. To produce dynamic and enterprising youngsters capable of facing the changing times and taking on the toughest technical challenges To equip students with knowledge, skills and values to enhance their employability opportunities</p>\n\n<p>Prospects<br />\nDiploma holders can be absorbed into various Government organizations like SCCL, GENCO, TRANSCO, DRDO, SAIL etc and Private organizations or can go for self-employment. They can appear for ECET to seek admission into II Year B.E / B.Tech in Engineering Colleges.</p>', 1),
(19, '16', 0x736b686a386b6174386538343077383034302e6a7067, '<p>About the Department:<br />\nThe department of Mechanical Engineering in Vaageswari College of Engineering 2nd shift polytechnic was established in the year 2013 with intake of 60 students and Faculty strength. The main focus of the department is to produce polytechnic students with Strong fundamentals in Mechanical Engineering Well equipped Laboratories/Workshops/Library, Dedicated and motivated faculty, special coaching classes for weak students, Focus on communication skills and soft skills to improve the personal skills of students</p>\n\n<p><br />\nVISION &amp; MISSION</p>\n\n<p><img alt=\"\" src=\"https://vgsek.ac.in/images/diplomaimages/mechImages/mech2.jpg\" /></p>\n\n<h3>VISION</h3>\n\n<p style=\"text-align:justify\">TThe Mechanical Engineering Department endeavors to be recognized globally for outstanding education and research leading to well qualified engineers, who are innovative, entrepreneurial and successful in advanced fields of mechanical engineering to cater the ever changing industrial demands and social needs.</p>\n\n<p>&nbsp;</p>\n\n<h3>Mission</h3>\n\n<p style=\"text-align:justify\">To imparting highest quality education to the students to build their capacity and enhancing their skills to make them globally competitive mechanical engineers.</p>\n\n<p style=\"text-align:justify\">To maintaining state of the art research facilities to provide collaborative environment that stimulates faculty, staff and students with opportunities to create, analyze, apply and disseminate knowledge.</p>\n\n<p style=\"text-align:justify\">To develop alliances with world class R&amp;D organizations, educational institutions, industry and alumni for excellence in teaching, research and consultancy practices.</p>\n\n<p style=\"text-align:justify\">To provide the students with academic environment of excellence, leadership, ethical guidelines and lifelong learning needed for a long productive career.</p>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<h3>Prospects</h3>\n\n<p style=\"text-align:justify\">Diploma holders can be absorbed into various Government organizations like SCCL, GENCO etc and Private organizations or can go for self-employment. They can appear for ECET to seek admission into II Year B.E / B.Tech in Engineering Colleges.</p>', 1);
INSERT INTO `dep_about` (`sno`, `department`, `banner`, `description`, `status`) VALUES
(20, '17', 0x707166323866676d32656f6f7334736767632e6a7067, '<p>About The Department<br />\nThe Department of HUMANITIES and SCIENCES was established in 2008. The department plays a vital role in grooming the students with basic knowledge of sciences and language. The department offers Chemistry, English, Mathematics and Physics devoted for all round development of I Year students.</p>\n\n<p>Science and Humanities Department imparts education on basics and fundamental theories of engineering i.e. Physics and Mathematics. Physics lab which provides basic knowledge of science and develops scientific acumen among students consist of experiments like Hall effect, Four Probe resistivity meter, Ultrasonic velocity meter, Hysteresis curve tracer etc. English language is taught rich collection of BBC documentaries based on science and engineering. through language lab and various other co-curricular activities. The lab has The department consists of highly qualified and well experienced faculty members</p>\n\n<p>It is the department where students learn to perform prodigious experiments and show their excellence. The department is involved in a number of activities like conducting seminars, workshops and guest lectures by eminent people of other universities and different organizations.</p>\n\n<p><br />\nVision:<br />\nThe College of Humanities and Social Sciences will become the premier liberal arts college in the intermountain west, providing the core intellectual and engaged learning experiences that prepare students for their role as active citizens and everyday leaders.</p>\n\n<p><br />\nMission<br />\nThe College of Humanities and Social Sciences seeks to create everyday leaders. The College supports excellence in education through a diverse, dynamic, and personalized academic environment that emphasizes engaged learning. We educate students to embody holistic knowledge, inspire critical thinking, possess dynamic oral and written communication skills, and become global citizens. Together, this education and training will equip students to make positive changes in their communities.</p>', 1),
(21, '16', 0x61306969636c6c676a6177773434306338672e6a7067, '<p>About the Department:<br />\nThe department of Mechanical Engineering in Vaageswari College of Engineering 2nd shift polytechnic was established in the year 2013 with intake of 60 students and Faculty strength. The main focus of the department is to produce polytechnic students with Strong fundamentals in Mechanical Engineering Well equipped Laboratories/Workshops/Library, Dedicated and motivated faculty, special coaching classes for weak students, Focus on communication skills and soft skills to improve the personal skills of students</p>\n\n<p>VISION &amp; MISSION</p>\n\n<p>The Mechanical Engineering Department endeavors to be recognized globally for outstanding education and research leading to well qualified engineers, who are innovative, entrepreneurial and successful in advanced fields of mechanical engineering to cater the ever changing industrial demands and social needs.</p>\n\n<p><br />\nMission<br />\nTo imparting highest quality education to the students to build their capacity and enhancing their skills to make them globally competitive mechanical engineers.</p>\n\n<p>To maintaining state of the art research facilities to provide collaborative environment that stimulates faculty, staff and students with opportunities to create, analyze, apply and disseminate knowledge.</p>\n\n<p>To develop alliances with world class R&amp;D organizations, educational institutions, industry and alumni for excellence in teaching, research and consultancy practices.</p>\n\n<p>To provide the students with academic environment of excellence, leadership, ethical guidelines and lifelong learning needed for a long productive career.</p>', 1),
(24, '13', 0x31756265663478656c336c776367773030632e6a7067, '<p>VISION &amp; MISSION</p>\n\n<p>&nbsp;</p>\n\n<p>Vision<br />\nTo impart quality education, to create professional engineers with basics in engineering field using technical skills and values.</p>\n\n<p><br />\nMission<br />\nTo enable industry research to develop into outstanding infrastructure, products and professionals with high ethical standards to face the challenges of the next millennium. To fulfill the experience of the society by equipping industries employee to stride forth resourceful citizens who are aware of their immense responsibilities to make the world a better place.</p>\n\n<p><br />\nProspects<br />\nCivil Engineering is one of the core branches of engineering. It is the second oldest engineering branch. It is an engineering discipline that focuses on design, planning, construction and maintenance of physically built as well as natural environment. The work of a civil engineer involves lots of drawing, sketching, planning, site work, material and human resource management, cost estimation, project planning and management, data collection and analysis, site supervision and finance management. Finally it is a very easy way to get Employment in Private sector as site engineer, planner, designer etc. &amp; in government sector as Assistant engineer, Town planning officer, deputy surveyor etc</p>\n\n<p><br />\nMoUs<br />\nTASK Telangana Academy for Skills and Knowledge was established by the Government of Telangana to enable a platform between Government, Academia and Industry to enhance employability quotient of students in the state. Vaageswari College of Engineering has MoU with Telangana Academy for Skill and Knowledge (TASK). This promotes to support for conducting Workshops, Internships &amp; Training programs to enhance student&rsquo;s technical skills. Thus, improving the success rate of employability</p>', 1),
(23, '14', 0x32757a776b636a6f6465326f7330733077342e6a7067, '<p><br />\n<strong><span style=\"font-size:16px\">About the Department:</span></strong></p>\n\n<p><br />\nThe department of Electronics &amp; Communication Engineering in vaageswari college of Engineering 2nd shift polytechnic was established in the year 2014 with intake of 60 students and Faculty strength. The main focus of the department is to produce polytechnic students with Strong fundamentals in Electronics &amp; Communication Engineering. Due to its modern infrastructure and exposure given to the students, it is one of the elite departments in India</p>\n\n<p>Diploma In Electronics and Communication Engineering is a diploma level Electronics and communication Engineering course.The focus of the course is on understanding electronics networks and devices, electric magnetic fields, computer fundamental, communication systems. Diploma in Electronics and Communication Engineering is a 3 year course. The academic program is divided into 6 semesters</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong><span style=\"font-size:18px\"> </span></strong></p>\n\n<p><strong><span style=\"font-size:18px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; VISION &amp; MISSION</span></strong></p>\n\n<p><span style=\"font-size:18px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img alt=\"\" src=\"http://vgsek.ac.in/images/diplomaimages/Ece%20Images/vision.PNG\" /></span></p>\n\n<p>&nbsp;</p>\n\n<p><br />\n<span style=\"font-size:16px\"><strong>Vision</strong>:</span><br />\nTo be a world class Engineering Institution in leading technological and socio-economic development of the country by enhancing the global competitiveness of technical manpower and by ensuring high quality technical education through dissemination of knowledge, insights and intellectual contributions.To become a center of excellence in teaching for creating technical manpower to meet the technological, societal and environmental needs of the country in the field of Electronics and Communication Engineering</p>\n\n<p><br />\n<span style=\"font-size:16px\"><strong>Mission</strong></span>:<br />\nTo Provide value based technical education and training in Electronics &amp; Communication Engineering and mould the character of younger generation to build our nation.<br />\nTo offer state of the art education of global standards through innovative methods of teaching and learning with practical orientation aiming to prepare the students for successful career and to provide required technological services.<br />\nTo prepare the students to think independently, take initiative, lead a team in an organization, take responsibility and solve the problems related to industry, society, environmental, health, safety and cultural issues maintaining the professional ethics.<br />\nTo pursue high quality contemporary research through continued interaction with research organizations and industries.</p>\n\n<p><span style=\"font-size:16px\"><strong>Prospects</strong></span>:<br />\nDiploma holders can be absorbed into various Government organizations like BSNL,BEL,GENCO, TRANSCO, DRDO, SAIL etc and Private organizations or can go for self-employment. They can appear for ECET to seek admission into II Year B.E / B.Tech in Engineering Colleges.</p>', 1),
(25, '18', 0x33393363786e3461626f6f77346f386373342e706e67, '<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;<span style=\"color:#FF0000\"><strong>M.Tech (CSE) - Program Educational Objectives (PEO&rsquo;s)</strong>:</span></p>\n\n<table border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:686px\">\n	<tbody>\n		<tr>\n			<td style=\"height:29px; width:65px\">\n			<p><span style=\"color:#0000FF\"><strong>Sl.No.</strong></span></p>\n			</td>\n			<td style=\"height:29px; width:111px\">\n			<p><span style=\"color:#0000FF\"><strong>PEO#</strong></span></p>\n			</td>\n			<td style=\"height:29px; width:510px\">\n			<p><span style=\"color:#0000FF\"><strong>Graduates of the Program will be able to</strong></span></p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:51px; width:65px\">\n			<p><strong>1</strong></p>\n			</td>\n			<td style=\"height:51px; width:111px\">\n			<p><strong>PEO - 1</strong></p>\n			</td>\n			<td style=\"height:51px; width:510px\">\n			<p>Analyze, simulate and solve multidisciplinary real-world problems using cutting-edge technology and software.</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:75px; width:65px\">\n			<p><strong>2</strong></p>\n			</td>\n			<td style=\"height:75px; width:111px\">\n			<p><strong>PEO &ndash; 2</strong></p>\n			</td>\n			<td style=\"height:75px; width:510px\">\n			<p>In the domain of Computer Science and Engineering, demonstrate competency in emerging technologies such as IoT, Artificial Intelligence, Machine Learning, Cyber Security and Data Science.</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:60px; width:65px\">\n			<p><strong>3</strong></p>\n			</td>\n			<td style=\"height:60px; width:111px\">\n			<p><strong>PEO &ndash; 3</strong></p>\n			</td>\n			<td style=\"height:60px; width:510px\">\n			<p>Develop lifelong learning, professional, and management skills for research and entrepreneurship towards nation building education</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"color:#FF0000\"><strong>M.Tech (CSE) &ndash; Program Outcomes (PO) Statements:</strong></span></p>\n\n<table border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:646px\">\n	<tbody>\n		<tr>\n			<td style=\"height:28px; width:61px\">\n			<p><span style=\"color:#0000FF\"><strong>&nbsp;Sl.No.</strong></span></p>\n			</td>\n			<td style=\"height:28px; width:97px\">\n			<p><span style=\"color:#0000FF\"><strong>PO#</strong></span></p>\n			</td>\n			<td style=\"height:28px; width:489px\">\n			<p><span style=\"color:#0000FF\"><strong>PO Statements</strong></span></p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:49px; width:61px\">\n			<p><strong>1</strong></p>\n			</td>\n			<td style=\"height:49px; width:97px\">\n			<p><strong>PO - 1</strong></p>\n			</td>\n			<td style=\"height:49px; width:489px\">\n			<p>An ability to independently carry out research /investigation and development work to solve practical problems</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:38px; width:61px\">\n			<p><strong>2</strong></p>\n			</td>\n			<td style=\"height:38px; width:97px\">\n			<p><strong>PO &ndash; 2</strong></p>\n			</td>\n			<td style=\"height:38px; width:489px\">\n			<p>An ability to write and present a substantial technical report/document</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:58px; width:61px\">\n			<p><strong>3</strong></p>\n			</td>\n			<td style=\"height:58px; width:97px\">\n			<p><strong>PO &ndash; 3</strong></p>\n			</td>\n			<td style=\"height:58px; width:489px\">\n			<p>Students should be able to demonstrate a degree of mastery over the area as per the specialization of the program. The mastery should be at a level higher than the requirements in the appropriate bachelor program</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"color:#FF0000\"><strong>M.Tech (CSE) - Program Specific Outcomes (PSO&rsquo;s):</strong></span></p>\n\n<table border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:646px\">\n	<tbody>\n		<tr>\n			<td style=\"height:28px; width:61px\">\n			<p><span style=\"color:#0000FF\"><strong>Sl.No.</strong></span></p>\n			</td>\n			<td style=\"height:28px; width:105px\">\n			<p><span style=\"color:#0000FF\"><strong>PSO#</strong></span></p>\n			</td>\n			<td style=\"height:28px; width:481px\">\n			<p><span style=\"color:#0000FF\"><strong>Program Specific Outcome Statements</strong></span></p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:72px; width:61px\">\n			<p><strong>1</strong></p>\n			</td>\n			<td style=\"height:72px; width:105px\">\n			<p><strong>PSO - 1</strong></p>\n			</td>\n			<td style=\"height:72px; width:481px\">\n			<p><strong>Development of Software Products and Applications: </strong>Use computing tools to understand, analyze, and design novel solutions for real-world and research-oriented challenges in emerging domains.</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:57px; width:61px\">\n			<p><strong>2</strong></p>\n			</td>\n			<td style=\"height:57px; width:105px\">\n			<p><strong>PSO &ndash; 2</strong></p>\n			</td>\n			<td style=\"height:57px; width:481px\">\n			<p><strong>Perspectives on Career, Research, and Entrepreneurship: </strong>Fulfilling a desire through achieving proficiency in ethics, global competitiveness, engaging in research leading to inventions, and being a successful entrepreneur.</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>', 1),
(26, '21', '', '<p>Data Science</p>', 1),
(27, '22', 0x32726f69316574376e3671736f67383834772e6a7067, '<p>The department of CSE (Data Science) was established in the year 2022 with an approved intake of 60. Data Science is a course combining wide areas of Statistics, Analytics, Knowledge Extraction and Data Visualization. In today&rsquo;s technical world, the exponential growth of data, requires a science ensuring that the huge volumes of data is handled accurately, analyzed efficiently, knowledge is extracted appropriately and visualized perfectly . Data Science is a complete integration of all these requirements.</p>\n\n<p>This course helps students to build mathematical and engineering skills required to advance their career as a Data Scientist or Data Analyst or Data Engineer and many more. The department aims to train students in rapidly growing areas of data science and encourage them for global certifications. The students will be motivated to complete their internships in companies and work on real time projects</p>\n\n<p>&nbsp;</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\"><span style=\"color:#FF0000\"><strong>Vision</strong></span></div>\n\n<p><br />\nTo acknowledge quality education and instill high patterns of discipline making the students technologically superior and ethically strong which involves the improvement in the quality of life in human race.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\"><span style=\"color:#FF0000\"><strong>Mission</strong></span></div>\n\n<p>To prepare Computer Science and Engineering graduates to be a lifelong learners with competence in basic science &amp; engineering and professional core, multidisciplinary areas, with continuous update of the syllabus, so that they can succeed in industry as an individual and as a team or to pursue higher studies or to become an entrepreneur.</p>', 1),
(28, '23', 0x76636d6175727379706463733434633034342e6a7067, '<p>.</p>', 1);
INSERT INTO `dep_achievements` (`sno`, `department`, `user`, `title`, `image`, `pdf`, `content`, `status`) VALUES
(1, '1', 'Student', '', '24j0dsjj8x6sk0wgws.jpg', '', '<p>Civil Engineering Final and Third year students did INTERNSHIPs in various Government organisations like Irrigation (Mission Kakatiya and Mission Bhagiratha) Roads and Buildings and Municipal Departments.</p>\n\n<p>Students from Civil Engineering Department participated in various Technical Activities like Paper presentation, Technical Seminar, Project Expo and Technical Fest in various organizations.</p>\n\n<p>III YEAR CIVIL ENGINEERING STUDENTS A.AKHILA AND S.SAI SNEHITHA PRESENTS MODEL OF &ldquo;WASTE WATER TREATMENT&rdquo; IN &ldquo;ANVESHANA 2018&rdquo; STATE LEVEL SCIENCE AND ENGINEERING FAIR ON 05/10/2017. AND GOT SPECIAL APPRECIATION BY SRI JAYESH RANJAN IAS SECRETARY OF DEPARTMENT OF IT, GOVT. OF TELANGANA.</p>', 1),
(2, '1', 'Student', 'FREE CLAY GANES IDOLS AND PLANTS', 'c0br29uodgoowo08c.jpg', '', '<p>VAAGESWARI COLLEGE OF ENGINEERING CIVIL ENGINEERING STUDENTS DISTRIBUTES &ldquo;FREE CLAY GANES IDOLS AND PLANTS&rdquo; ON 24/08/2017.</p>', 1),
(3, '1', 'Student', '', '1qfp8ffzonr4wswgk.jpg', '', '<p>II CIVIL ENGINEERING STUDENTS CELEBRATES &ldquo;NEW YEAR CELEBRATIONS AT &ldquo;BALASADAN(ORPHON HOME)&rdquo; THROUGH &ldquo;SAHAYA FOUNDATION&rdquo; ON 01/01/2015 AT KARIMNAGAR.</p>', 1),
(4, '5', 'Faculty', 'International Conference Chair', '', '', '<p>1. Organized International Conference on Innovations &amp; Discoveries in Science, Engineering and Management (ICIDSEM-2018), April 9-10 at Vaageswari college of Engineering, Karimnagar, Telangana.</p>\n\n<p>&nbsp;</p>\n\n<h3>Books &amp;&nbsp;Patents:1.Dr.M.Ramesh,Dr.Sai Ram Inkollu, Basic Concepts of Electrical Engineering, LuluPublications,978-0-359-67421-3,2019.</h3>\n\n<p>2. Dr.M.Ramesh,V.,Hari Babu, Power System and Economic Operation of Power System, Lulu Publications,978-0-359-67709-2,2019.</p>\n\n<p>&nbsp;</p>\n\n<h3>Awards:</h3>\n\n<p>&nbsp;</p>\n\n<p>1. BHARAT VIKAS AWARD 2017</p>\n\n<p>2. BEST TEACHER AWARD 2018</p>\n\n<p>3. EXCELLENCE RESEARCH AWARD 2018</p>\n\n<p>4. Dr.APJ Abdul Kalam Life Time Achievement Award 2019</p>\n\n<p>https://vgsek.ac.in/images/eee/awards-converted.pdf</p>', 0),
(5, '5', 'Student', 'Students Achievements', 'ppl93xaeghwk0s4wck.jpeg', '', '<h3>Event</h3>', 1),
(33, '5', 'Student', 'Students Achievements', '2ifnu75fl5c0c48wcg.jpeg', '', '<p>Visit</p>', 1),
(34, '5', 'Student', 'Students Achievements', '1l7eapqs1v288w08w0.jpeg', '', '<p>Event</p>', 1),
