conomics (IRIRE),&nbsp; New Delhi. 1&amp;2 November, 2014.</span></li>\n</ol>\n\n<p>&nbsp;</p>\n\n<ol>\n	<li><span style=\"font-size:12px\">&ldquo;Commercial Banks Services to MSMEs in India &ndash; A Study&rdquo;, International Conference on Managing Changes in Business and Economy, Pacific Academy of Higher Education and Research University, Udaipur,&nbsp; 6<sup>th</sup>&amp;7<sup>th</sup> April, 2013.</span></li>\n</ol>\n\n<p>&nbsp;</p>\n\n<ol>\n	<li><span style=\"font-size:12px\">&ldquo;Indian Service Sector &amp; Foreign direct Investment&rdquo; &ndash; A Study&rdquo;, International Conference on Managing Changes in Business and Economy, Pacific Academy of Higher Education and Research University, Udaipur,&nbsp; 6<sup>th</sup>&amp;7<sup>th</sup> April, 2013.</span></li>\n</ol>\n\n<p>&nbsp;</p>\n\n<ol>\n	<li><span style=\"font-size:12px\">&ldquo;Credit Services to MSMEs by Commercial Banks in India&rdquo;, National seminar on Strategic Initiatives in Management to Meet the Global Economic Challenges &ndash; 23<sup>rd</sup> Feb. 2013, Green Heaven Institute of Management and Research, Nagpur, ISBN <strong>978-93-81432-53-2 </strong>(pages 223-234), 23<sup>rd</sup> February 2013.</span></li>\n</ol>\n\n<p>&nbsp;</p>\n\n<ol>\n	<li><span style=\"font-size:12px\">Role of Stakeholders in Delivering Quality Management Education&rdquo;, National Seminar on Strengthening Industry &ndash; Academia Interface for Enhancement of Quality Management Education - Bharatiya Vidya Bhavan&rsquo;s Vivekananda College of Science, Humanities and Commerce Sainikpuri, Secunderabad, ISBN No. 978-81-7276-486-8 pages 92-103, 6<sup>th</sup> December, 2012.</span></li>\n</ol>\n\n<p>&nbsp;</p>\n\n<ol>\n	<li><span style=\"font-size:12px\">&ldquo;Flow of Foreign Direct Investment&rdquo; &ndash; National Seminar on Impact of Globalization on Indian Economy, SRR Govt. Degree College &ndash; Karimnagar, pages 151-157, 22<sup>nd</sup> &amp; 23<sup>rd</sup> January 2010</span></li>\n</ol>\n\n<p>&nbsp;</p>\n\n<ol>\n	<li><span style=\"font-size:12px\">&ldquo;FDI Policy and Flow of FDI and India&rdquo; &ndash; National Seminar on Contemporary Management &ndash; issues and Challenges - Osmania University, ISSN &ndash; 978-935024-658-0, pages 120-125. 20<sup>th</sup> &amp; 21<sup>st</sup> August, 2010.</span></li>\n</ol>\n\n<p style=\"margin-left:37.5pt\">&nbsp;</p>\n\n<p><span style=\"font-size:12px\"><strong><u>Workshops/FDPs/Webinars: 08</u></strong></span></p>\n\n<p>&nbsp;</p>\n\n<ul>\n	<li><span style=\"font-size:12px\">Participated Five Days (23<sup>rd</sup> &ndash; 27<sup>th</sup> May 2023) Faculty Development Program on Skills Reengineering in Business Management organized by Andhra Loyola Institute of Engineering and Technology, Kakinada.</span></li>\n	<li><span style=\"font-size:12px\">Participated Five Days (5<sup>th</sup> &ndash; 9<sup>th</sup> April 2021) Faculty Development Program on Data Analysis with R, organized by St. Joseph&rsquo;s College of Commerce, Bangalore.</span></li>\n</ul>\n\n<p>&nbsp;</p>\n\n<ul>\n	<li><span style=\"font-size:12px\">Participated One Week (20<sup>th</sup> &ndash; 26<sup>th</sup> May 2020) Faculty Development Program on Skill to Improve Teaching Performance and Productivity &ndash; Post Covid 19, organized by Dr. K.V. Subba Reddy School of Business, Kurnool.</span></li>\n	<li><span style=\"font-size:12px\">Participated One Week (13<sup>th</sup> &ndash; 18<sup>th</sup> May 2019) Faculty Development Program on Pedagogy and ICT in Higher Education, organized by Teaching Learning Center, NIT-Warangal and Vaageswari College of Engineering Karimnagar.</span></li>\n</ul>\n\n<p>&nbsp;</p>\n\n<ul>\n	<li><span style=\"font-size:12px\">Participated One Week (17<sup>th</sup> &ndash; 22<sup>nd</sup> December 2018) Faculty Development Program on Business Analytics organized by School of Management, NIT-Warangal.</span></li>\n</ul>\n\n<p>&nbsp;</p>\n\n<ul>\n	<li><span style=\"font-size:12px\">Participated One day (15<sup>th</sup> December, 2016), Faculty Development Program in Research in Accounting organized by Department of Accounting - India School of Business conducted and Dhanwantari Institute of Science and Technology Hyderabad.</span></li>\n</ul>\n\n<p>&nbsp;</p>\n\n<ul>\n	<li><span style=\"font-size:12px\">Participated One day (12<sup>th</sup> July 2013), conducted by National Small Industries Corporation Limited (NSIC), Hyderabad, training program on Analytical Research Techniques Using SPSS</span></li>\n</ul>\n\n<p>&nbsp;</p>\n\n<ul>\n	<li><span style=\"font-size:12px\">Participated two days (26<sup>th</sup> and 27<sup>th</sup> Feb. 2021) International Vision Seminar on Sustainability in the Age of Disruption, organized by Globsyn Business School.</span></li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:12px\"><strong><u>Session Chair/Keynote Speaker/Guest Lectures: 02</u></strong></span></p>\n\n<p>&nbsp;</p>\n\n<ol>\n	<li><span style=\"font-size:12px\">Key Note Presentation in International Conference on Managing Change in Business &amp; Economy conducted by Pacific University, Udaipur on Services Sector on 6<sup>th</sup> and 7<sup>th</sup> of April, 2013.</span></li>\n	<li><span style=\"font-size:12px\">Key Note Presentation in International Conference on &ldquo;Relative Economic on Economic Reforms in India&rdquo; at New Delhi conducted by Pacific University, Udaipur and International Research Institute of Real Economics (IRIRE), New Delhi. on 1<sup>st</sup> and 2<sup>nd</sup> Nov. 2014.</span></li>\n</ol>\n\n<p style=\"margin-left:37.5pt\">&nbsp;</p>\n\n<p><span style=\"font-size:12px\"><strong><u>Memberships in Professional/Academic Bodies: 03</u></strong></span></p>\n\n<p>&nbsp;</p>\n\n<ul>\n	<li><span style=\"font-size:12px\">Life Member - Indian Accounting Association (HY &ndash; 127)</span></li>\n</ul>\n\n<p>&nbsp;</p>\n\n<ul>\n	<li><span style=\"font-size:12px\">Life Member &ndash; Indian Commerce Association</span></li>\n</ul>\n\n<p>&nbsp;</p>\n\n<ul>\n	<li><span style=\"font-size:12px\">Life Member-Management Teachers Consortium&ndash;Global (MTC &ndash; Global) Bangalore.</span></li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:12px\"><strong>Dr. Ch. Vijay Kumar</strong></span></p>\n\n<p><span style=\"font-size:12px\"><strong>Associate Professor</strong></span></p>\n\n<p><span style=\"font-size:12px\"><strong>Presented Papers in the National and Internal Seminars:</strong></span></p>\n\n<p><span style=\"font-size:12px\">A paper presented on <strong>&ldquo;Stock Price Volatility &ndash; Influencing Factors&rdquo;</strong>, International&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Conference on Managing Change in Business &amp; Economy organized by Faculty of Management Studies, Pacific Academy of Higher Education &amp; Research University, Pacific University, Udaipur, Rajasthan, India on 6<sup>th</sup> to 7<sup>th</sup> April, 2013.</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:12px\">Presented a Paper on Working Women In Call Centres-Stress Related Issues, at UGC Sponsored National Seminar on &quot;Impact of Globalization of Indian Economy&quot; conducted by Department of Commerce, SRR Govt. Degree &amp; PG College, Karimnagar (22nd &amp; 23rd January, 2010).</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:12px\">Presented a paper on Impact of global and US Financial Crisis on Indian Banking and Financial Services&quot; in the National Seminar on &quot;Impact of Global Financial Crisis on Indian Economy&quot; at Department of Commerce, Telangana University, Nizamabad, Andhrabad (25th and 26th Feb. 2010)</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:12px\">Presented a paper on &quot;Impact of Globalization on Banking Services in India&quot; in the National Seminar on &quot;Globalization: The New challenges to the Indian Society&quot; at Department of Sociology, Satavahana University, Karimnagar (6th and 7th March, 2010).</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:12px\">Participated in international Conference on &quot;Business Vision - 2020&quot; organized by Acharya&quot;s Bangalore B-School, Banglore on 15th &amp;16th April, 2010, and presented a paper on &quot;Population, Income and Business in India - The future perspective&quot;.&nbsp;</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:12px\">Presented a paper on Corporate Social Responsibility for attaining sustainable growth&quot; in the International Conference on Management Practices for Sustainable Growth&quot; at Department of Business Administration and Management Wing, Annamalai University (28th - 30th July, 2010).</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:12px\">Presented a paper on &quot;skills for management Students - ITES Industry&quot; at Sathavahana University PG College, Karimnagar, on 31st April, 2009.</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:12px\">Presented a paper on &quot;Venture Capital Financing in India - A view&quot; at National Seminar on &quot;New Horizons in Financial Services Management - Challenges and Solutions&quot; organised by the Department of Business Management, Kakatiya University, Warangal (April 25th, 2008).</span></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:12px\"><strong>Articles Published:</strong></span></p>\n\n<p><span style=\"font-size:12px\"><strong>Green Banking &ndash; bye-bye cheques, hello electronic payments,</strong> Asia Pacific Journal of Management and Entrepreneurship, A scholarly, Peer Reviewed, Bi-Annual, Open Access, Online Research Journal, Volume1, Issue 3, Nov 2012, ISSN 2277 &ndash; 8098.</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:12px\"><strong>Green Transportation &ndash; Public Sector Transport System,</strong> Asia Pacific Journal of Management and Entrepreneurship, A scholarly, Peer Reviewed, Bi-Annual, Open Access, Online Research Journal, Volume1, Issue 3, Nov 2012, ISSN 2277 &ndash; 8098.</span></p>\n\n<p style=\"margin-left:18.0pt\">&nbsp;</p>\n\n<p><span style=\"font-size:12px\"><strong>Role of Business Correspondents in Financial Inclusion </strong>article published in Global Business Strategies &ndash; Touching New Horizons, Zenon Academic Publishing 2014, Hyderabad with ISBN 978-81-926819-2-4.</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:12px\"><strong>Quality Improvement Programmes:</strong></span></p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:12px\">Faculty Development Programme on &quot;Creating Online Courses and Alternative Assessment Tests&quot; by the Institute of Public Enterprise, Shamirpet, Hyderabad. on May 14th, 2023.</span></p>\n\n<p style=\"margin-left:36.0pt\">&nbsp;</p>\n\n<p><span style=\"font-size:12px\">Training Program on &quot;Google Apps from Scratch&quot; (Training Program), Christopher Arts and Sciences College, Tiruneveli, Tamil Nadu, One Week from 16th August 2021 to 22nd August,2021</span></p>\n\n<p style=\"margin-left:36.0pt\">&nbsp;</p>\n\n<p><span style=\"font-size:12px\">Recent Trends in Education, Technology &amp; Management (FDP), Milagres College, Kallianpur &amp; GFGC Kavoor, Mangalore, 30th July, 2021 to&nbsp;&nbsp; 8th August, 2021, One Week.</span></p>\n\n<p style=\"margin-left:36.0pt\">&nbsp;</p>\n\n<p><span style=\"font-size:12px\">One Week International FDP on New Paradigms of Teaching (FDP), by Nallamuthu Gounder Mahalingam College, Affiliated to Bharathiar University, Pollachi, Coimbatore, Tamilnadu, from 22nd May, 2020 to&nbsp;&nbsp; 29th May, 2020. .</span></p>\n\n<p style=\"margin-left:36.0pt\">&nbsp;</p>\n\n<p><span style=\"font-size:12px\">Pedagogy and ICT in Higher Education (FDP), Teaching Learning Centre, NIT Warangal &amp; Vaageswari College of Engineering, Karinagar, from 13th May, 2019 to&nbsp;&nbsp; 18th May, 2019.</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:12px\">Realizing Objectives with Project Management Skills (Workshop), at University Industry Interaction Centre (UIIC), Jawaharlal Nehru Technological University, Hyderabad, on 5th January, 2019.</span></p>\n\n<p style=\"margin-left:36.0pt\">&nbsp;</p>\n\n<p><span style=\"font-size:12px\">Training Programme&nbsp; on Problem Solving and Decision Making<strong> &nbsp;</strong>Organized by National Institute of Technical Teachers&#39; Training And Research, Kolkata. (Established by the Ministry of Human Resources Development, Government of India), 31st December, 2018 to&nbsp; 04th January, 2019.</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:12px\">A one day workshop on &ldquo;Enterpreneurship Development&rdquo; by The National Small Industries Corporation Ltd., on 27<sup>th</sup> February, 2013 organised by Vaageswari Institute of Management Sciences, Karimnagar.</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:12px\">Faculty Development Programme on Finance Modeling Using Excel at Siva Sivani Institute of Management, Kompally, Secunderabad. (16th and 17th September, 2011).&nbsp;&nbsp;</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:12px\">Faculty Development Programme on Technical Analysis. (Area: Security Analysis) at Sree Chaitanya Institute of Management and Computer Sciences, Thimmapur, Karimnagar. (17th and 18th&nbsp; February, 2011).</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:12px\">Faculty Development Programme on Competency Maping at Indian Institute of Technology (IIT), Kharagpoor, Calcutta. (1<sup>st </sup>-14<sup>th </sup>August, 2009).</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:12px\">Attended Certificate Course on Capital Markets, organised by Sree Chaintanya College of Engineering, Thimmapur, Karimnagar (25<sup>th </sup>- 27<sup>th </sup>November, 2009).</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:12px\">Faculty Development Programme, conducted by Indian Society for Technical Education, New Delhi and Organised by Vaageswari College of Engineering, Thimmapur, Karimnagar (8<sup>th </sup>to 10<sup>th</sup> Augest, 2008)</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:12px\">National Conference of Finance and Banking, Organised by Saintgits Institute of Management Association, Kottayam, Kerala (8th &amp; 9th September 2008).</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:12px\">Attended Training Programme on &quot;Thinking Beyond Boundaries&quot; conducted by Hyderabad Management Association (HMA), Hyderabad (13th December, 2008).</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:12px\">Participated National Workshop on Financial Innovation (FI-2008), conducted by the Centre for Management Studies, National Institute of Technology (NIT) Warangal (16th - 18th December, 2008).</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:12px\">Faculty Development Programme on Business Finance, School of Management, Arts and Science College, Kakatiya University, Warangal (5th - 10th Jan, 2006).</span></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>', 1),
