(8, '8', 'Faculty', 'Faculty Achievements:', '', '', '<p>Conferences: (National /International):</p>\n\n<p>Dr.V.Bapuji<br />\nNational: 2</p>\n\n<p>International: 4</p>\n\n<p>D. Srinivas Reddy<br />\nNational: 3</p>\n\n<p>International: 3</p>\n\n<p><br />\nDr.V.Bapuji<br />\nIEEE</p>\n\n<p>ACM</p>\n\n<p>CSI</p>\n\n<p>IAENG</p>\n\n<p>Society of Artificial Intelligence</p>\n\n<p>Society of Computer Science</p>\n\n<p>Society of Scientific Computing</p>\n\n<p>Society of Wireless Networks</p>\n\n<p>IAER</p>\n\n<p>D. Srinivas Reddy<br />\nIEEE</p>\n\n<p>ACM</p>\n\n<p>CSI</p>\n\n<p>IAENG</p>\n\n<p>Society of Artificial Intelligence</p>\n\n<p>Society of Computer Science</p>\n\n<p>Society of Scientific Computing</p>\n\n<p>Society of Wireless Networks</p>\n\n<p>IAER</p>', 1),
