(10, '6', 'Student', 'A Major project on \"A Battery & solar powered car\"', 'r9gr2t64k34oksgo04.jpg', '', '<p>A Major project on &quot;A Battery &amp; solar powered car&quot; successfully completed by 2015-2019 batch Mechanical engineering students</p>', 1),
(12, '6', 'Student', 'BOOSTER CAR', 'ns1u4pp57b4wsckck0.jpg', '', '<p>Our Mechanical Engineering Students Mr. V. Avinash and team completed a Major Project &ldquo;BOOSTER CAR&rdquo; (2017).</p>', 1),
(13, '4', 'Student', 'STUDENT ACHIEVEMENTTS', '', '', '<p>&bull; Ms. K. Anusarika, secured Third Rank in &ldquo;Poster Making Contest on COVID-19 Pandemic&rdquo; held from 4th May &ndash; 12th May 2020 organized by Priyadarshini Institute of Engineering and Technology, Nagpur.</p>\n\n<p>&bull; IV B.Tech I Sem students published 12 papers in International Journal of Emerging Trends in Engineering and Basic Sciences (IJEEBS) ISSN (Online) 2349-6967, Volume 7, Issue 2 (March-April 2020)</p>\n\n<p>&bull; Present final and third year students attended INTERNSHIP in various core companies like NTPC, BHEL, ECIL,etc</p>\n\n<p>&bull; Students from ECE Department participated in various Technical Activities like Paper presentation, Technical Seminar, Project Expo and Technical Fest in various organizations.</p>\n\n<p>eduhome<br />\nThe society was established by an eminent and educated personalities in the name of Goddess Saraswathi Devi, Sree Vaageswari Educational Society during the year 2003 under the leader ship of General Secretary Dr.G.Sreenivas Reddy Garu..</p>', 1),
(14, '4', 'Faculty', 'FACULTY ACHIEVEMENTS', '', '', '<p>&bull; Dr. Venkata Reddy Adama was recognized as a reviwer for the journal</p>\n\n<p>&nbsp; &nbsp;&quot; Internation Journal of Research and Innovation in Applied Science( IJRIAS)</p>\n\n<p>&bull; Dr. Venkata Reddy Adama published a book entitled &quot;Control Systems&quot;&nbsp;</p>\n\n<p>&bull; Venkata Reddy Adama published a paper in Springer Journal in 2021</p>\n\n<p>&bull; Venkata Reddy Adama published a paper in scopus Indexed Journal in 2020</p>\n\n<p>&bull; Most of the faculty members attended One Week online FDP under ATAL</p>\n\n<p>&bull; Dr.Sathyam Bonala has received Silver Medal from Dr.A.P.J Abdul Kalam Best M.Tech student in NIT ROURKELA</p>\n\n<p>&bull; ECE faculty members attended NBA Workshop (1 week) conducted by NITTTR, Kharagpur.</p>\n\n<p>&bull; Most of the faculty members attended 1 week workshop on PEDAGOGY AND ICT IN HIGHER EDUCATION conducted by NIT, Warangal in May 2019.</p>\n\n<p>&bull; R.Naraiah and U.Rajender published a paper in scopus Indexed International Journal in 2019.</p>\n\n<p>&bull; Department faculty members published 30 papers in reputed International / National journals.</p>\n\n<p>&nbsp;<br />\n&nbsp;<br />\n&nbsp;</p>', 1),
(32, '3', 'Faculty', 'FACULTY ACHIEVEMENTS', '', '', '<p>&nbsp;</p>\n\n<p style=\"text-align: center;\"><strong>PATENTS</strong></p>\n\n<table border=\"1\" cellpadding=\"0\" cellspacing=\"0\">\n	<tbody>\n		<tr>\n			<td style=\"height:77px; width:36px\">\n			<p>1</p>\n			</td>\n			<td style=\"height:77px; width:132px\">\n			<p>Dr. N.Chandramouli</p>\n\n			<p>HOD &amp; Associate Professor,CSE Department</p>\n			</td>\n			<td style=\"height:77px; width:359px\">\n			<p><strong>ENHANCED COMMUNICATION FOR MOBILES</strong></p>\n\n			<p>The present invention is an enhanced communication for mobiles comprises of, a receiver is used to collect data from various a mobile node thereby , it is for a specific location, thereby, assessing the entire signal to that vicinity, therein , which increase the strength on that particular location</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:77px; width:36px\">\n			<p>2</p>\n			</td>\n			<td style=\"height:77px; width:132px\">\n			<p>Dr. N.Chandramouli</p>\n\n			<p>HOD &amp; Associate Professor, CSE Department</p>\n			</td>\n			<td style=\"height:77px; width:359px\">\n			<p><strong>IOT BASED AUTOMATED TOLL GATE TAX COLLECTION SYSTEM USING CLOUD DATABASE</strong></p>\n\n			<p>Every region of our planet has a system of automatic smart roll gates. As a result ,human intervention is reduced , and there is less room for error. The most important benefit of automation is that machines and hardware become more reliable and trustworthy, while humans become less reliant on them</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:77px; width:36px\">\n			<p>3.</p>\n			</td>\n			<td style=\"height:77px; width:132px\">\n			<p>Dr.Srikanth Reddy E</p>\n\n			<p>Associate Professor</p>\n			</td>\n			<td style=\"height:77px; width:359px\">\n			<p><strong>BLOCK CHAIN WITH DEEP LEARNING &ndash; BASED SECURE COMPUTING PLATFORM FOR HEALTHCARE DATA</strong></p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:77px; width:36px\">\n			<p>4</p>\n			</td>\n			<td style=\"height:77px; width:132px\">\n			<p>Dr.Srikanth Reddy E</p>\n\n			<p>Associate Professor</p>\n			</td>\n			<td style=\"height:77px; width:359px\">\n			<p><strong>A MACHINE LEARNING BASED APPROACH TO PLOT GRAPHS BASED ON STATISTICAL DATA ANALYSIS OF PATIENTS SUFFERING FROM CANCER DUE TO ALCOHOL CONSUMPTION</strong></p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p style=\"text-align: center;\"><strong>BOOKS published by Faculty</strong></p>\n\n<p style=\"text-align: center;\">&nbsp;</p>\n\n<p>1. Dr. Gulab Singh Chouhan &nbsp;published a book entitled &rdquo;<strong>Mobility Models:</strong> <strong>comparison Environment for Routing protocols&rdquo;</strong> A.P.H Publishing corporation in the year 2017.</p>\n\n<p>2. Dr.Gulab Singh chouhan published a paper &nbsp;entitled &rdquo;<strong>Flaws and advantages of</strong> <strong>Mobile computing</strong>&rdquo; in the year 2017.</p>\n\n<p>3. Dr.Dinesh kumar, Dr. N.Chandramouli,Dr. V.Bapuji &nbsp;published a book entitled &rdquo;&nbsp;<strong>Multimedia systems Design</strong> &rdquo;Scientific International publishing house in the year 2020.</p>\n\n<p>4. Dr.V.Bapuji,Dr. Gulab Singh chouhan ,Ramyasree Thirupathigiri published a book entitled&rdquo; <strong>Python programming&rdquo;</strong> Scientific International publishing house in the year 2020.</p>\n\n<p>5. Dr.V. Bapuji, Dr. D. Srinivas Reddy published a book entitled &rdquo;<strong>Machine</strong> <strong>learning</strong>&rdquo;Scientific International publishing house in the year 2020.</p>\n\n<p>6. Dr.Gulab Singh chouhan, Mr. S. Sathish Reddy,Mr.R.Sagar published a book entitled &rdquo;<strong>Web Development</strong>&rdquo; Scientific International publishing house in the year 2020.</p>\n\n<p>7. Dr.Dinesh kumar, Mr.Veluru Harish Reddy,Dr.N.Chandramouli published a book entitled&rdquo; <strong>Introduction Artificial Intelligence and Data science</strong>&rdquo; Scientific International publishing house in the year 2020.</p>\n\n<p>8. Dr.D.Srinivas Reddy,Dr. Gulab Singh chouhan published a book entitled &rdquo;<strong>Web Development&rdquo;</strong> Scientific International publishing house in the year 2020.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p style=\"text-align: center;\"><span style=\"font-size:14px\"><strong>Courses attended by Faculty</strong></span></p>\n\n<p>1. K.Vidya has completed NPTEL course on &ldquo;<strong>Introduction to Internet things</strong>&rdquo; in the year(Jan-Apr 2022).</p>\n\n<p>2. K.Soujanya has completed NPTEL course on &ldquo;<strong>Object oriented analysis</strong> <strong>&amp;Design</strong>&rdquo; in the year(Aug-oct 2019).</p>\n\n<p>3. T.Ravi kumar has completed NPTEL course on &ldquo;<strong>Software Engineering</strong>&rdquo; in the year(Jul-Oct 2019).</p>\n\n<p>4. T.Ravi kumar has completed NPTEL course on &ldquo;<strong>Software Testing</strong>&rdquo; in the year(Jan-Feb 2020).</p>', 1),
