(30, '14', 'Faculty', 'FACULTY ACHIEVEMENTS', '', '', '<p>G.PRATHEEPA &ldquo;Design And Operation Of Parallel Carry-Save Pipelined RSFQ Multiplier For Digital Signal Processing&rdquo; International Journal Of VLSI System Design And Communication Systems</p>\n\n<p>U.RAJENDER &ldquo;Tunable Subthreshold logic design through Adaptive Feedback Equalization&rdquo; in IJART ISSN: 2457-0362</p>\n\n<p>U.RAJENDER &ldquo;Designing of Low power Micro cordic processor For real time Antenna array Applications using VLSI&rdquo; in IJART ISSN: 2457-0362</p>\n\n<p>U.RAJENDER &ldquo;Delay Approximation Model for Prime Speed Interconnects in Current Mode in IJITEE&rdquo; ISSN: 2278-3075</p>\n\n<p>U.RAJENDER &ldquo;Conventional Static Cmos Based Logic circuits Design Through Adaptive feedback Equalization&rdquo; ISSN: 2651-4451</p>\n\n<p>U.RAJENDER &ldquo;Tunbale Sub Threshold Logic Design Through Adaptive Feedback Equalization&rdquo;</p>\n\n<p>A.ARUN KUMAR &ldquo; Analysis Of Rectangular Resonant Microstrip Antenna Loaded With Meta-Material &amp; A Slot Load Microstrip Antenna&rdquo; International Journal Of Reasearch</p>', 1),
(31, '15', 'Student', 'Students Achiements', 'jreufuofd0gg480kgc.jpg', '', '<p>Ms.Aileni supriya, bearing HT No 13489-EE-001 has selected as &ldquo;Sub-Engineer&rdquo;</p>\n\n<p><br />\nMany students got Engineering admissions through E-CET in JNTUH, OU, JNTUCEJ, JNTUCEM and many more reputed institutions</p>', 1),
(23, '2', 'Faculty', 'Faculty Achievements', '', '', '<p>Faculty Achievements<br />\nList of Faculty Registered for Ph.D Degree in 2018</p>\n\n<p>Mrs.Y.Susheela</p>\n\n<p><strong>Books and Journals Published</strong></p>\n\n<p>1. Dr. Gulab Singh Chouhan &nbsp;published a book entitled &rdquo;<strong>Mobility Models:</strong>&nbsp;<strong>comparison Environment for Routing protocols&rdquo;</strong>&nbsp;A.P.H Publishing corporation in the year 2017.</p>\n\n<p>2. Dr.Gulab Singh chouhan published a paper &nbsp;entitled &rdquo;<strong>Flaws and advantages of</strong>&nbsp;<strong>Mobile computing</strong>&rdquo; in the year 2017.</p>\n\n<p>3. Dr.Dinesh kumar, Dr. N.Chandramouli,Dr. V.Bapuji &nbsp;published a book entitled &rdquo;&nbsp;<strong>Multimedia systems Design</strong>&nbsp;&rdquo;Scientific International publishing house in the year 2020.</p>\n\n<p>4. Dr.V.Bapuji,Dr. Gulab Singh chouhan ,Ramyasree Thirupathigiri published a book entitled&rdquo;&nbsp;<strong>Python programming&rdquo;</strong>&nbsp;Scientific International publishing house in the year 2020.</p>\n\n<p>5. Dr.V. Bapuji, Dr. D. Srinivas Reddy published a book entitled &rdquo;<strong>Machine</strong>&nbsp;<strong>learning</strong>&rdquo;Scientific International publishing house in the year 2020.</p>\n\n<p>6. Dr.Gulab Singh chouhan, Mr. S. Sathish Reddy,Mr.R.Sagar published a book entitled &rdquo;<strong>Web Development</strong>&rdquo; Scientific International publishing house in the year 2020.</p>\n\n<p>7. Dr.Dinesh kumar, Mr.Veluru Harish Reddy,Dr.N.Chandramouli published a book entitled&rdquo;&nbsp;<strong>Introduction Artificial Intelligence and Data science</strong>&rdquo; Scientific International publishing house in the year 2020.</p>\n\n<p>8. Dr.D.Srinivas Reddy,Dr. Gulab Singh chouhan published a book entitled &rdquo;<strong>Web Development&rdquo;</strong>&nbsp;Scientific International publishing house in the year 2020.</p>\n\n<p>&nbsp;</p>', 1),
