(7, '5', 'B.TECH', '4 years (8-SEMESTERS)', 30, '<p>Admissions to regular B.Tech programmes are made based on the rank secured in Engineering, Agriculture &amp; Medicine common entrance test (EAMCET) conducted by Telengana State Council of Higher Education, Hyderabad. Three year diploma holders, with engineering common entrance test (ECET) ranking are eligible for admission into B.Tech Programmes.</p>', 1),
(6, '3', 'B.Tech CSE', '4 years (8 SEMESTERS)', 180, '<p>Admissions to regular B.Tech programmes are made based on the rank secured in Engineering, Agriculture &amp; Medicine common entrance test (EAMCET) conducted by Telengana State Council of Higher Education, Hyderabad. Three year diploma holders, with engineering common entrance test (ECET) ranking are eligible for admission into B.Tech Programmes.</p>', 1),
(3, '4', 'B.TECH', '4 Years (8 SEMESTERS)', 150, '<p>Admissions to regular B.Tech programmes are made based on the rank secured in Engineering, Agriculture &amp; Medicine common entrance test (EAMCET) conducted by Telengana State Council of Higher Education, Hyderabad. Three year diploma holders, with engineering common entrance test (ECET) ranking are eligible for admission into B.Tech Programmes</p>', 1),
(18, '16', 'Diploma (Mechanical Engineering)', '3 Years', 60, '<p>Candidate who have passed SSC or its equivalent examinationrecognized by the board of secondary education, TS,<br />\nHyderabad are eligible to apply. The candidates who have compartmentally passed or appearing for SSC are also eligible to apply.</p>', 0),
(15, '2', 'B.Tech CSE', '4 years (8 SEMESTERS)', 180, '<p>Admissions to regular B.Tech programmes are made based on the rank secured in Engineering, Agriculture &amp; Medicine common entrance test (EAMCET) conducted by Telengana State Council of Higher Education, Hyderabad. Three year diploma holders, with engineering common entrance test (ECET) ranking are eligible for admission into B.Tech Programmes.</p>', 1),
(16, '1', 'B.Tech(UG)', '4 Years (8 Semesters)', 30, '<p>Admission to regular B Tech Programmes are made based on the ranks secured in EAMCET conducted by TS council of higher education, Hyderabad. 3 years Diploma Holders with ECET ranking are eligible for admission into B Tech programmes.</p>', 1),
(17, '1', 'Diploma (Civil Engineering)', '3 Years (6 Semesters)', 60, '<p>Candidate who have passed SSC or its equivalent examination recognized by the board of secondary education, TS, Hyderabad are eligible to apply. The candidates who have compartmentally passed or appearing for SSC are also eligible to apply.</p>', 0),
(21, '13', 'Polytechnic Diploma', '3 years', 60, '<p>Candidate who have passed SSC or its equivalent examination recognized by the board of secondary education, TS, Hyderabad are eligible to apply. The candidates who have compartmentally passed or appearing for SSC are also eligible to apply.</p>', 0),
(19, '14', 'DIPLOMA', '3 Years', 60, '<p>Candidate who have passed SSC or its equivalent examination recognized by the board of secondary education, TS, Hyderabad are eligible to apply. The candidates who have compartmentally passed or appearing for SSC are also eligible to apply.</p>\n\n<p>&nbsp;</p>', 0),
(20, '15', 'Polytechnic Diploma', '3 years', 60, '<p>Eligibility criteria</p>\n\n<p>Candidate who have passed SSC or its equivalent examinationrecognized by the board of secondary education, TS,<br />\nHyderabad are eligible to apply. The candidates who have compartmentally passed or appearing for SSC are also eligible to apply.</p>', 0),
(9, '3', 'M.Tech CSE', '2 years (4 SEMESTERS)', 30, '<p>The candidates must have passed Graduation in B.Tech or equivalent from recognized board or university. General category students should obtain a minimum 50% and for reserved candidates, the minimum aggregate is 45%.</p>', 1),
(10, '5', 'M.TECH (POWER ELECTRONICS)', '2 years', 18, '<p>Admissions to regular M.Tech&nbsp; programme in constituent colleges/Units of the University are based on GATE or PGECET ranking respectively conducted by Telengana State Council of Higher Education, Hyderabad.</p>', 1),
(14, '4', 'M.TECH(VLSI & ES)', '2 Years (4 Semesters)', 18, '<p>The candidates must have passed Graduation in B.Tech or equivalent from recognized board or university. General category students should obtain a minimum 50% and for reserved candidates, the minimum aggregate is 45%.</p>', 0),
(11, '6', 'B.Tech', '4years(8 semesters)', 30, '<p>Admission to regular B Tech Programmes are made based on the ranks secured in EAMCET conducted by TS council of higher education, Hyderabad. 3 years Diploma Holders with ECET ranking are eligible for admission into B Tech programmes.</p>\n\n<p>&nbsp;</p>', 1),
(12, '6', 'Diploma (Mechanical Engineering)', '3 years(6 Semesters)', 60, '<p>Candidate who have passed SSC or its equivalent examination recognized by the board of secondary education, TS, Hyderabad are eligible to apply. The candidates who have compartmentally passed or appearing for SSC are also eligible to apply.</p>\n\n<p>&nbsp;</p>', 0),
(13, '7', 'MBA', '2 Years (4 SEMESTERS)', 180, '<p>Admissions to regular MBA&nbsp; programme&nbsp;in constituent colleges/Units of the University are based on ICET&nbsp;ranking respectively conducted by Telangana State Council of Higher Education, Hyderabad.</p>', 1),
(22, '22', 'Computer Science & Engineering (Data Science)', '4 Years', 60, '<p><span style=\"color:rgb(129, 134, 138); font-family:poppins; font-size:14px\">Admissions to regular B.Tech programmes are made based on the rank secured in Engineering, Agriculture &amp; Medicine common entrance test (EAMCET) conducted by Telengana State Council of Higher Education, Hyderabad. Three year diploma holders, with engineering common entrance test (ECET) ranking are eligible for admission into B.Tech Programmes.</span></p>', 1),
(23, '23', 'M-Tech (PE)', '2 years', 18, '<p>Admissions to regular M.Tech&nbsp; programme in constituent colleges/Units of the University are based on GATE or PGECET ranking respectively conducted by Telengana State Council of Higher Education, Hyderabad.</p>', 1),
(24, '8', 'MCA', '2 Years (4 SEMESTERS)', 120, '<p>Admissions to regular MCA&nbsp; programme in constituent colleges/Units of the University are based on ICET&nbsp;ranking respectively conducted by Telengana State Council of Higher Education, Hyderabad.</p>', 1);
