INSERT INTO `dep_hod_msg` (`sno`, `department`, `hod`, `message`, `status`) VALUES
(9, '8', '7', '<p><span style=\"color:#FF0000\"><strong>HOD-Message</strong></span></p>\n\n<p>The department vision is to ensure high valued computer education to students. The primary focus of the department is to empower our students to solving real world problems in the society. Students are facilitated with personality development/communication skills and full stack programs for better placements. On-campus certification programs, Quizzes and other co-curricular activities are organized part of the schedule. Faculty/Students take initiative for social causes at individual level and as team under different branches/clubs of the institute. Turning a student into a good citizen is the prime aim of the department. The department maintain extremely experienced faculty, high academic standards and to compete in the fast-changing global technologies. Very good placement track record, regular workshops/seminars to impart high value based education by the academicians and industry experts. We are the team to redefine ourselves to take the department &ldquo;Lead the Future&hellip;&rdquo;</p>\n\n<p>&nbsp;</p>\n\n<p>Best Wishes</p>\n\n<div class=\"container\" style=\"box-sizing: border-box; margin-right: auto; margin-left: auto; padding-left: 15px; padding-right: 15px; width: 1200px; color: rgb(96, 96, 96); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px;\">\n<p><strong>Dr.V.Bapuji<br />\nHOD &amp; Professor</strong></p>\n\n<p><strong>Department of MCA</strong></p>\n\n<p><strong>Mobile: + 91 98484 93616</strong></p>\n\n<p><strong>Email ID: dr.v.bapuji@vgsek.ac.in</strong></p>\n\n<p><strong>bapuji.vala@gmail.com</strong></p>\n</div>', 1),
(8, '7', '83', '<h3><span style=\"color:#FF0000\"><span style=\"font-size:18px\"><strong>HOD-Message</strong></span></span></h3>\n\n<p>&nbsp;</p>\n\n<p>Master of Business Administration (MBA) is a professional course in today&rsquo;s global scenario is considered as a basic qualification for managerial positions in business organizations in Finance, Marketing, and HR areas or departments.</p>\n\n<p>The main objectives of the MBA program are to achieve the three major goals i.e., &ldquo;Learning&rdquo; (pertains to imparting conceptual knowledge about management), &ldquo;Doing&rdquo; (pertains to developing managerial skills to enhance their employability) and the &ldquo;Being&rdquo; (pertains to inculcating values and ethics). Keeping this view JNTUH is framed unique pedagogy for MBA curriculum including experiential and outcome based learning.</p>\n\n<p>In order to achieve these three objectives, the Department of Business Management, Vaageswari College of Engineering has highly competent, committed and proficient faculty who have associated their personal aims and growth with this institution. We concentrate on providing managerial and entrepreneurial skills with an aim to build and develop balanced managers in next century under the uncertainties and complexities of the dynamic global scenario. The MBA program in our institution is supplemented by regular corporate interactions by way of guest lectures from industry experts and value added programmes like workshops, seminars, symposia, soft skills, life skills, IT skills, live projects, financial modeling, digital marketing etc.</p>\n\n<p>It is fact that future managers will have a very tough time and they should make rational decisions in complex situations. Keeping this view, we, faculty of the Department of Business Management, Vaageswari College of Engineering, are endorsing our best efforts to develop holistic managers who will be capable of managing the business organization in the best professional way.</p>\n\n<p><strong>Dr. E. Hari Prasad,</strong></p>\n\n<p><strong>Professor &amp; HOD</strong></p>\n\n<p><strong>Mobile - 9490072311.</strong></p>\n\n<p><strong>email - hod.mba@vgsek.ac.in</strong></p>\n\n<p>&nbsp;</p>', 1),
(21, '1', '1', '<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\"><span style=\"font-size:14px\"><span style=\"color:#FF0000\"><strong>HOD-Message</strong></span></span></div>\n\n<p>On behalf of all our faculty, staff and students, I would like to welcome you to the Civil Engineering Department at Vaageswari College of Engineering.</p>\n\n<p>The Department of Civil Engineering is emerging as one of the fastest growing branches by imparting quality education to the students in all the major areas of civil engineering. The department is forecasting the vision of the college and striving hard for making students technically excellent, culturally vibrant, socially responsible and globally competent.</p>\n\n<p>The students are exposed to practical real time studies there by training them to analyze and provide solution for the same. Along with curricular, students are trained in all dimensions by means of seminar, workshops, Hands on work, technical talks, industrial visit, internships, site visit and many more. This provides a well built platform to enhance their enthusiasm and practical knowledge, which makes them to be confident to tackle any civil engineering challenges and be advanced and innovative with the growing technology.</p>\n\n<p><strong>Mr. K.RAJESH<br />\nHOD &amp; Professor</strong><object classid=\"clsid:d27cdb6e-ae6d-11cf-96b8-444553540000\" codebase=\"http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,40,0\" height=\"2\" hspace=\"2\" vspace=\"3\" width=\"1\"><param name=\"allowFullScreen\" value=\"true\" /><param name=\"quality\" value=\"high\" /><param name=\"movie\" value=\"www.vgesek.ac.in\" /><embed height=\"2\" hspace=\"2\" pluginspage=\"http://www.macromedia.com/go/getflashplayer\" quality=\"high\" src=\"www.vgesek.ac.in\" type=\"application/x-shockwave-flash\" vspace=\"3\" width=\"1\"></embed></object></p>\n\n<p><strong>Ph.NO: 9133245888</strong></p>\n\n<p><strong>Mail Id: civil.hod@vgsek.ac.in</strong></p>', 1),
(6, '4', '16', '<p><span style=\"font-size:14px\"><span style=\"color:#FF0000\"><strong>HOD-Message</strong></span></span></p>\n\n<p>Dr. Venkata Reddy Adama is Professor and HOD in the Department of Electronics and Communication Engineering. He is having 21&nbsp;years of experience in Teaching. He completed&nbsp;Ph.D from Nagpur University (RTMNU- Rashtrasant Tukadoji Maharaj Nagpur University) Nagpur, Maharashtra. He has received M.Tech (Embedded Systems) from Jawaharlal Nehru Technological University Hyderabad and B.Tech Degree from Jawaharlal Nehru Technological University Hyderabad.</p>\n\n<p>His Teaching and Research interests include Communication Systems, Wireless Sensor Networks and Cognitive Radio. He has 16 publications in reputed International Journals and Conferences.</p>\n\n<p><strong>Dr. Venkata Reddy Adama</strong></p>\n\n<p><strong>HOD &amp; Professor</strong></p>\n\n<p><strong>Ph.No:&nbsp;8121860999</strong></p>\n\n<p><strong>Email : ece.hod@vgsek.ac.in</strong></p>', 1),
(17, '13', '133', '<p><br />\nMr.E.VENU<br />\nMr.E.Venu obtained B.Tech. degree in Civil Engineering from JNTU Hyderabad, India in 2014, M.Tech degree in Structural Engineering from JNTU, Hyderabad, India in 2018. He has been working as Assistant Professor and Head of Civil Engineering Department (Polytechnic) from October 2019 to till date. His areas of research include Studies on Repair &amp;Rehabilitation of Concrete Elements, Analysis of Sustainable Structures etc. He guided number of B.Tech and Polytechnic projects.</p>\n\n<p>Contact HOD<br />\nMr.E.VENU</p>\n\n<p>B.TECH, M.TECH</p>\n\n<p>ASSISTANT PROFESSOR&amp; HOD of CIVIL ENGINEERING (Polytechnic),</p>\n\n<p>VAAGESWARI COLLEGE OF ENGINEERING, KARIMNAGAR, TS</p>\n\n<p>MOBILE NO: 9666733247, 9908626912</p>\n\n<p>E-Mail Id:venuetikyala@gmail.com</p>', 1),
(7, '5', '37', '<p><span style=\"color:#FF0000\"><strong>HOD-Message</strong></span></p>\n\n<p>Welcome to the department of Electrical and Electronic Engineering at Vaageswari College of Engineering, Karimnagar, Telangana. The department works with the objective of addressing critical challenges faced by the Industry, society and the academia. Perhaps even more important is our unceasing commitment to our students, helping them to learn, grow, develop, and achieve their goals in their pursuit to excel in their professional career.</p>\n\n<p>&nbsp;Department of Electrical and Electronic Engineering is one of the largest department in Vaageswari College of Engineering with nearly 18 faculty members and&nbsp;more than 500&nbsp;undergraduate and master&rsquo;s students. The department&rsquo;s graduate programs continue to draw from a very strong application pool. The department was established in the year 2005 and since its inception the department has evolved from offering only undergraduate courses to offer post graduate in key areas of electrical and Electronic engineering.</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The department faculty work with excellent team spirit in different technical team like Power System, Electrical Machines, Power Electronics, Modern Electric Drives, Control System, Renewable Energy,&nbsp;Electrical Measurement &amp; Instrumentation, Power Generation, Communication systems, Electronic gadgets, Programming of Microcontroller, Digital System Design etc.&nbsp;&nbsp;which leads to key research publications&nbsp; in these areas. The department strives to provide a conductive environment for the students to develop analytical and practical skills and apply them to real world problems. To motivate the students the department organizes regular training in state of art software &amp; hardware, arranges workshop, technical events, seminars &amp; industrial visit.</p>\n\n<p>&nbsp;We welcome you to the Electrical and Electronic Engineering Department as undergraduate or post graduate or research student and we hope to be part of your success.</p>\n\n<p><strong>Dr. K. Chandramouli</strong></p>\n\n<p><strong>HOD &amp; Professor</strong></p>\n\n<p><strong>Ph.No: 9848744424</strong></p>\n\n<p><strong>Email: hod.eee@vgsek.ac.in</strong></p>\n\n<p><strong>It is generally believed that it is the students who derive benefit by working under the guidance of a professor. In reality, the professor benefits equally by his association with gifted students working under him.&nbsp; -C. V. Raman</strong></p>', 1),
(5, '6', '42', '<p><span style=\"font-size:14px\"><span style=\"color:#FF0000\"><strong>HOD-Message</strong></span></span></p>\n\n<p>It is my honor and privilege to welcome you all to the Department of Mechanical Engineering at Vaageswari College of Engineering.</p>\n\n<p>The department of Mechanical Engineering is the widely recognized branch of all the engineering expertise. Mechanical engineering deals with complex machinery systems to reduce the human efforts. The Department of Mechanical Engineering focuses on forecasting vision of the college in providing a quality education and promoting practical based learning environment towards innovative technology.</p>\n\n<p>We constantly motivate students to increase knowledge, enhancing the critical thinking for practical and theoretical skill development knowledge. Utmost importance is given to impart good quality technical education along with moral values.</p>\n\n<p>Along with our curriculum, we strive to ensure all our young students to be trained by means of seminar, workshops, technical walks, industrial visit internships and many more. Our department maintains active research groups for carrying out collaborative and interdisciplinary research. We have state of the art research facilities to support our academic programs and research. This provides an excellent academic credential platform to enhance overall development of the students.</p>\n\n<p><strong>Mr. D. Vijay Kumar</strong></p>\n\n<p><strong>HOD &amp; Professor</strong></p>\n\n<p><strong>Ph.no: 91-9866973951</strong></p>\n\n<p><strong>Email: hod.mech@vgsek.ac.in</strong></p>', 1),
(14, '2', '8', '<p><span style=\"color:#FF0000\"><strong><span style=\"background-color:#D3D3D3\">HOD-Message</span></strong></span></p>\n\n<p>Greetings!</p>\n\n<p>Welcome to the Department of Computer Science and Engineering (Artificial Intelligence &amp; Machine Learning) at Vaageswari college of Engineering, Karimnagar. It gives me immense pleasure to lead the Department of Computer Science and Engineering (AI&amp;ML) which is striving towards the goal of providing innovative and quality education to the students to achieve academic excellence.</p>\n\n<p>The motto of our Department of&nbsp;CSE(AI&amp;ML) at vaageswari college of engineering is to instill innovative and quality technical education to the students in the field of Artificial Intelligence &amp; Machine Learning. The faculty and non-teaching staff of the department is committed to make our students to be industry-ready after their graduation. Our goal is to ensure that our engineering graduates are well prepared to play the roles of problem solvers, project leaders, entrepreneurs, and above all ethical citizens of a global society.</p>\n\n<p>The excellent infrastructure, Eminent teaching faculty along with training and placement cell ensure a bright future to the students. The greatest asset of the department is its highly motivated and learned faculty. The faculty members are involved in research and development activities and many of them are pursuing their Ph.D., in their related domains. Department has conducted several workshops, webinars and addon courses for the benefit of the students.</p>\n\n<p>We&nbsp;are&nbsp;confident&nbsp;that&nbsp;the Department of CSE (AI&amp;ML) is committed to instilling high patterns of discipline, quality education, and knowledge in order to make our students technically superior and ethically strong, so that they will emerge as assets not only to the institution and to the organization they join, but to society at large.</p>\n\n<p>With this, I would like to congratulate the students and staff for their brilliant achievements and wish them a great future. We continue on this journey with our commitment to excellence by saying</p>\n\n<p><strong>&ldquo;Predicting the future isn&rsquo;t magic, it&rsquo;s artificial Intelligence and machine learning&rdquo;.</strong></p>\n\n<p><strong>Dr. E. Srikanth Reddy<br />\nHOD &amp; Professor</strong></p>\n\n<p><strong>Mobile: +91 &ndash; 9052531155</strong></p>\n\n<p><strong>E-mail: vgse.csehod@vgsek.ac.in</strong></p>', 1),
(10, '3', '5', '<p><span style=\"color:#FF0000\"><strong>HOD Message</strong></span></p>\n\n<p>It is a great privilege for me to be part of the Vaageswari College of Engineering. Welcome all the students &amp; their parents to the Department of Computer Science and Engineering. Department of Computer Science &amp; Engineering commits to work towards developing Engineers with a rich blend of competent, technical, managerial and social skills and contribute to nation building. Our Department has produced hundreds of professionals and has established a name for itself in the country and abroad. To meet the objectives, department focus special emphasis on teaching and hands on practical work. The excellent infrastructure, teaching faculty of the best kind of the Department ensuring quality education such as interaction among students, parents and staff, along with a Training and Placement Cell ensures a bright future to the students. I invite you to be part of our efforts as we propel the department of Computer Science &amp; Engineering to ever-greater heights. I congratulate to the team of faculty members and the students for their brilliant and original efforts.</p>\n\n<p><strong>Dr. N. Chandramouli</strong></p>\n\n<p><strong>HOD &amp; Professor</strong></p>\n\n<p><strong>Ph.No: 9849750204</strong></p>\n\n<p><strong>Email : cse.hod@vgsek.ac.in</strong></p>', 1),
(12, '9', '38', '<p><span style=\"color:#FF0000\"><strong>HOD-Message</strong></span></p>\n\n<p>On behalf of all our faculty members, staff and students, I feel it is a great privilege for me to share my message with you and I welcome you to our Vaageswari College of Engineering. The department is forecasting the vision of the college and striving hard for making students sure to prepare them compatible for &lsquo;industry ready&rsquo;.</p>\n\n<p>Students are participating in various co-curricular activities throughout the year. Our teaching and learning process is based on the Outcome Based Education (OBE). English reigns supreme among all the other languages in the world. It plays a pivotal role in determining the future of any engineer and has become the part and parcel of the engineering curriculum. The department places a strong emphasis on imparting practical education by carefully administering proper lab work for imparting communication skills and employability skills.</p>\n\n<p>Students are encouraged to communicate only in English while on campus. The students are exposed to practical real time studies there by training them to analyze and provide solution for the same. Along with curricular, students are trained in all dimensions by means of seminar, workshops, Hands on work, technical talks and many more. This provides a well built platform to enhance their enthusiasm and practical knowledge, which makes them to be confident to tackle any challenges to face employability skills and be advanced and innovative with the growing technology.</p>\n\n<p><strong>Mr M. VIDYA SAGAR</strong></p>\n\n<p><strong>HOD &amp; Professor</strong></p>\n\n<p><strong>Ph.no: 7386848320</strong></p>\n\n<p><strong>Mail: english.hod@vgse.ac.in</strong></p>', 1),
(13, '11', '88', '<h3><span style=\"font-size:18px\"><strong><span style=\"color:#FF0000\">HOD-Message</span></strong></span></h3>\n\n<p>The Department of Chemistry providing the academic excellence also holds a wide range of intellectual and creative discussions through the platform of conferences, seminars. The faculty members of the department are actively involved in research also. Our course topics are designed to provide students the knowledge of Engineering Chemistry, and also introduce them to various experimental skills. The subject has become as an essential part of the curriculum for all the branches of Engineering. The department is quite successfully offering quality education with the future perspective.</p>\n\n<p><strong>Dr.J. Sandhya Reddy</strong></p>\n\n<p><strong>HOD &amp; Professor</strong></p>\n\n<p><strong>Department of Chemistry</strong></p>\n\n<p><strong>Mobile: +91- 9502343953</strong></p>\n\n<p><strong>Email: vgse.chemistryhod@gmail.com</strong></p>', 1),
(15, '1', '29', '<p>HOD-Message</p>\n\n<p><br />\nMr. K.RAJESH<br />\nAssistant Professor &amp; HOD<br />\nMobile:&nbsp;8121860999</p>\n\n<p>email: vgse.ecehod@gmail.com</p>\n\n<p><br />\nOn behalf of all our faculty, staff and students, I would like to welcome you to the Civil Engineering Department at Vaageswari College of Engineering.</p>\n\n<p>The Department of Civil Engineering is emerging as one of the fastest growing branches by imparting quality education to the students in all the major areas of civil engineering. The department is forecasting the vision of the college and striving hard for making students technically excellent, culturally vibrant, socially responsible and globally competent.</p>\n\n<p>The students are exposed to practical real time studies there by training them to analyze and provide solution for the same. Along with curricular, students are trained in all dimensions by means of seminar, workshops, Hands on work, technical talks, industrial visit, internships, site visit and many more. This provides a well built platform to enhance their enthusiasm and practical knowledge, which makes them to be confident to tackle any civil engineering challenges and be advanced and innovative with the growing technology.</p>', 0),
(16, '12', '127', '<p><span style=\"color:#FF0000\"><strong><span style=\"font-size:13px\">WELCOME TO THE DEPARTMENT OF MATHEMETICS,</span></strong></span></p>\n\n<div>&nbsp;</div>\n\n<div><span style=\"font-size:13px\">The Department of Mathematics at Vaageswari College of Engineering was established in 2005 and provides the students with the mathematical foundation required to analyse all engineering courses.It has been extensively engaged in teaching of engineering students.</span></div>\n\n<div>&nbsp;</div>\n\n<div><strong><span style=\"color:#FF0000\"><span style=\"font-size:13px\">THE DEPARTMENT HAS CURRENTLY 6&nbsp;WELL QUALIFIED,EXPERIENCED FACULTY.</span></span></strong></div>\n\n<div>&nbsp;</div>\n\n<div><span style=\"font-size:13px\">The Department offers Engineering Mathematics -I, Mathematics -II ,Probability&amp; Statistics,Discrete Mathematics,Computer Oriented Statistical methods , Laplacetransforms ,Numerical methods &amp;Complexvariables for U.G students of B.Tech courses, and Probability &amp;Statstics ,Discrete Mathematics &amp; Operational Research for P.G courses. The Department also help to the students in mini and major projects for various engineering branches.</span></div>\n\n<div>&nbsp;</div>\n\n<div><span style=\"font-size:13px\">The objective of the department is to provide the young students into professionals with the mathematical foundation required to analyse all engineering courses.</span></div>\n\n<div>&nbsp;</div>\n\n<div><span style=\"font-size:13px\">The Department provides services to the entire institute for UG / PG studentsin engineering.The aim of the department is to pursue excellence in mathematics through teaching.we are achieving our objectives with the help of significantly experienced faculty.</span></div>\n\n<div>\n<p><strong>Mr. B.Ramana Reddy</strong></p>\n\n<p><strong>HOD &amp; Professor</strong></p>\n\n<div><strong>Mobile: 9700048237</strong></div>\n\n<div><strong>Mail: maths.hod@vgsek.ac.in</strong></div>\n</div>', 1),
(18, '17', '134', '<p><img alt=\"\" src=\"https://vgsek.ac.in/images/devdas.jpg\" /></p>\n\n<p>Mr.K.Devadas obtained M.A. degree in English from Kakatiya University, Warangal, India in 2008, Have been working as an Assistant Professor and Head of H&amp;Sc Department (Polytechnic) from 2017 to till date. Guided to the students to develop communication skills and Life skills. Would like to express pride to belong to the English Department, for language is the key to knowledge, culture and civilization, it represents a bridge of communication with others. Undoubtedly, English is a worldwide language. It is taught in most universities, hence the need to meet universal standards to master the English language.</p>\n\n<p><br />\nCONTACT HOD<br />\nMr.K.Devadas</p>\n\n<p>M.A.English,B.Ed.</p>\n\n<p>ASSISTANT PROFESSOR &amp; HOD OF H&amp;SC (Polytechnic),</p>\n\n<p>VAAGESWARI COLLEGE OF ENGINEERING,KARIMNAGAR,TS</p>\n\n<p>MOBILE:9959531274</p>\n\n<p>E-Mail ID:- kb.devadas@gmail.com</p>', 1),
(19, '16', '141', '<p>Mr.J.Vijay Kumar obtained B.Tech in Mechanical engineering from JNTUH Hyderabad,india in 2008. M.Tech degree in Machine Design from JNTUH Hyderabad India in 2013. He has been working as an assistant professor and head of mechanical section (polytechnic) from OCT-2014 to till date. His areas of research include mechanical in thermal power plant at ramagundam and automobile spare parts include manufacturing, production, design and analysis etc. He guided number of B.Tech and polytechnic projects. He has also been working as an examination in-charge for diploma board examination section since 2014. He has conducted an organized many motivational programs like one day workshop for students bright career as per SBTET academic curriculum</p>', 1),
(20, '15', '147', '<p>HOD-Message</p>\n\n<p>Mr.G. Srikanth obtained B.Tech. degree in Electrical and Electronics Engineering from JNTUH Hyderabad, India in 2003, M.Tech degree in Power Electronics from JNTUH, Hyderabad, India in 2006 and pursing Ph.D from Sri Satya Sai University of Technology and Medical Sciences Bhopal, Madhya Pradesh. He has been working as Associate Professor and Head of EEE Department (Polytechnic) from October 2005 to till date. His areas of research include Power electronics, HVDC Transmission Systems, Power system Stability etc. He guided number of M.Tech, B.Tech and Polytechnic projects. He has publications in international journals and presented several papers in national and international conferences. He is a Life Member of Indian Society of Technical Education (M.I.S.T.E).</p>', 1),
(22, '2', '8', '<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\"><strong>HOD-Message</strong></div>\n\n<p><br />\nIt is a great privilege for me to be part of the Vaageswari College of Engineering. Welcome all the students &amp; their parents to the Department of Computer Science and Engineering. Department of Computer Science &amp; Engineering commits to work towards developing Engineers with a rich blend of competent, technical, managerial and social skills and contribute to nation building. Our Department has produced hundreds of professionals and has established a name for itself in the country and abroad. To meet the objectives, department focus special emphasis on teaching and hands on practical work. The excellent infrastructure, teaching faculty of the best kind of the Department ensuring quality education such as interaction among students, parents and staff, along with a Training and Placement Cell ensures a bright future to the students. I invite you to be part of our efforts as we propel the department of Computer Science &amp; Engineering to ever-greater heights. I congratulate to the team of faculty members and the students for their brilliant and original efforts.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Dr. N. Chandra Mouli.<br />\nHOD &amp; Professor</strong></p>\n\n<p><strong>Mobile: +91 &ndash; 9849750204</strong></p>\n\n<p><strong>E-mail: vgse.csehod@gmail.com</strong></p>', 1),
(23, '22', '329', '<p><span style=\"color:rgb(255, 0, 0)\"><strong>HOD Message</strong></span></p>\n\n<p>It is a great privilege for me to be part of the Vaageswari College of Engineering. Welcome all the students &amp; their parents to the Department of Computer Science and Engineering( Data Science). Department of Computer Science &amp; Engineering(Data Science) commits to work towards developing Engineers with a rich blend of competent, technical, managerial and social skills and contribute to nation building. Our Department has produced hundreds of professionals and has established a name for itself in the country and abroad. To meet the objectives, department focus special emphasis on teaching and hands on practical work. The excellent infrastructure, teaching faculty of the best kind of the Department ensuring quality education such as interaction among students, parents and staff, along with a Training and Placement Cell ensures a bright future to the students. I invite you to be part of our efforts as we propel the department of Computer Science &amp; Engineering to ever-greater heights. I congratulate to the team of faculty members and the students for their brilliant and original efforts.</p>\n\n<p><strong>Dr. N. Chandramouli</strong></p>\n\n<p><strong>HOD &amp; Professor</strong></p>\n\n<p><strong>Ph.No: 9849750204</strong></p>\n\n<p><strong>Email : cse.hod@vgsek.ac.in</strong></p>', 1);
