(93, 'Computer Lab', '3iyi9rnxx7eoocwg00.jpg', '', '', '<p>A computer lab is a space which provides computer services to a defined community. Computer labs are typically provided by libraries to the public, by academic institutions to students who attend the institution,[1] or by other institutions to the public or to people affiliated with that institution. Users typically must follow a certain user policy to retain access to the computers. This generally consists of the user not engaging in illegal activities or attempting to circumvent any security or content-control software while using the computers.. Computers in computer labs are typically equipped with internet access, while scanners and printers may augment the lab setup. Computers in computer labs are typically arranged either in rows, so that every workstation has a similar view of one end of the room to facilitate lecturing or presentations, or in clusters, to facilitate small group work. In some cases, generally in academic institutions, student laptops or laptop carts take the place of dedicated computer labs, although computer labs still have a place in applications requiring special software or hardware not practically implementable in personal computers.</p>', '17', 1),
(94, 'WORKSHOP PRACTICE LAB', 'jdtn4wqescg08skkss.jpg', '', '', '<p>Mechanical Engineering Workshop is a place where students acquire basic knowledge of various tools and various processes involved in manufacturing and production. Engineers must expose themselves to all working trades, so that they can get view of the basic practical activities involved with all sections of manufacturing. They must understand the activities and practical difficulties, so that they can take appropriate decisions in future. The Workshop Practice course makes students theory complete with practical work in engineering environment</p>', '16', 1),
(95, 'MATERIAL TESTING LAB', 'bcm8koxlaw0k4o4c40.jpg', '', '', '<p>Strength of any material play important role in designing of any component, there are different strength properties which influence the various characteristics for different applications under the action of various kind of loading.</p>\n\n<p>MTP lab is to impart practical knowledge of hardness, tensile strength, shear strength, flexural rigidity, load strain behavior, ultimate strength, toughness, torsional rigidity, stiffness and rigidity of springs and compressive strength etc.</p>', '16', 1),
