(75, 'DC Machines Lab', '6iq7e484eio0wokog0.jpg', '', '', '<p>The objective of the DC Machines Laboratory is to impart knowledge about characteristics and behavior of the DC Machines, operation of DC machines and give them experimental skill, familiarize with the constructional details of different types, working principle and their performance. It also provides the essential facilities to the students to augment their concepts about the fundamentals of rotating machines. It is well equipped lab to provide experimental and hands-on experience to the detailed study of characteristic and operational aspects of DC electrical machines.</p>\n\n<p>Facilities:DC Shunt Motor - Generator Set (04 Nos), DC Shunt Motor - Series Generator Set (02 Nos), DC Shunt Motor - Compound Generator (02 Nos), Identical DC Shunt Machines, Identical DC Series Machines, DC Shunt Motor (05 Nos)</p>', '5', 1),
