(55, 'Digital Signal Processing Lab', 'lmignykvn40488ossw.jpg', '', '', '', '4', 1),
(78, 'Power Electronics Lab', '2q447xmmt7uogw0s4s.jpg', '', '', '<p><br />\nThe objective of the Power Electronics laboratory is to study the characteristics of switching devices and its applications in rectifiers, AC voltage controllers, inverter and choppers. It also acquaint with the application of electronic devices for conversion, control and conditioning of electric power. Further it aids the students to acquire an overview of different types of power semiconductor devices and to cognize the operation, characteristics and performance parameters of controlled rectifiers.</p>\n\n<p>The principle of operation, switching techniques, modulation techniques and harmonic reduction techniques in PWM inverters are studied in the lab. It also provides experience with common components such as motors, batteries and power semiconductors. The lab facilitates faculty and students who are conducting research, industry sponsored projects in power converters in particular and electrical energy conversion in general.</p>\n\n<p>Facilities: Silicon controlled rectifier, TRAIC, DIAC, MOSFET and IGBT Characteristics study unit, Operational Amplifier Trainer, DC Chopper power unit, UJT firing circuit, Forced Commutation study unit, fully controlled converter power circuit, Cycloconverter power circuit, Parallel Inverter, Half controller converter power circuit, Series Inverter, AC voltage controller, power scopes</p>', '5', 1),
(79, 'Power Systems Lab', 'a4r68z315m0os48skw.jpg', '', '', '<p>This laboratory is designed to give students hands-on experience on different equipment of electrical power system. This is an advanced laboratory to carry out modeling, simulation and analysis of power system equipments. Students can practically verify several concepts and procedures learned in power system modeling and analysis. This lab has facilities to study the protection of equipment by relays in conjunction with switchgear. This lab also helps to model and analyze the dynamics of power system for small signal and large signal disturbances and design the systems for enhancing stability. It familiarizes with the preparatory work necessary for meeting the next day&rsquo;s operation and the various control actions to be implemented on the system to get an overview of system operation and control, to understand and model power-frequency dynamics and to design power-frequency controller, to understand and model reactive power-voltage interaction and different methods of control for maintaining voltage profile against varying system.</p>\n\n<p>Facilities: Power Generation Simulation Unit, Transmission Line Simulation Unit, Feeder Protection Simulation Unit, Microprocessor based relay, differential relay, sequence components set-up, fault analysis set-up, Earth fault relay, Over voltage relay, Megger.</p>', '5', 1),
(80, 'Electrical Measurements and Instrumentation Lab', '2s0y0kt70oe8so4ssk.jpg', '', '', '<p><br />\nThe aim of the Electrical Measurements Laboratory is to reinforce the students with an adequate work experience in the measurement of different quantities and also to expertise in handling the instruments involved. The basic operations of sensors and the process where it might be used, practically realized in the laboratory.</p>\n\n<p>It also provides facilities to train the students in the measurement of displacement, resistance, inductance, torque and angle etc., and to give exposure to AC, DC bridges and transient measurement. These sensors and signal conditioning circuits are then implemented in various projects and real time applications</p>\n\n<p><br />\nFacilities: Transformer oil testing set up, Single Phase Energy Meter (02 Nos), DC Potentiometer, Kelvin&rsquo;s Double Bridge, Schering and Anderson&rsquo;s Bridge, Current Transformers (06 Nos), Strain Guage Kit, LVDT Kit, Dynamometer power factor meter, Thermostat, Resistance Temperature Detector, Thermocouple, Thermistor, Bidirectional energy meter, Encoders, Speed, Pressure and distance measurement set ups, watt meters.</p>', '5', 1),
(81, 'control Systems Lab', 'k7tlj9hl4eo8sgc8go.jpg', '', '', '<p>The aim of the Control Systems laboratory is to provide sound knowledge in the basic concepts of linear control theory and design of control systems, to understand the methods of representation of systems and getting their transfer function models. It facilitates basic knowledge in obtaining the open loop and closed loop responses to understand the concept of stability of control systems. It also helps the students to study the compensation design for a system.</p>\n\n<p>Facilities<strong>:&nbsp;</strong>Linear System Simulator Kit (02 Nos), PLC Trainer Units, PID Controller Trainer Kit, Temperature Control System Study Kit, Servo Motor, PCs, MATLAB R2015a.</p>', '5', 1),
(91, 'Physics Lab', '18r7n1h5aspw4s4w44.jpg', '', '', '<p>Physics is an experimental science. The theoretical concepts and relationships introduced in the lecture part of the course describe the general nature and behavior of real phenomena. They were, appropriately, discovered by (or inducted from) careful observation and thoughtful analysis of actual experiments. Genuine understanding entails being able to relate the abstract ideas to the particular facts to which they correspond.</p>\n\n<p>The premise of the scientific method is that (observation of) nature is the ultimate judge of the truth of any physical theory. Indeed, experiments designed to prove certain ideas have often ended up showing them to be wrong. Consequently, all physical concepts must be verified experimentally if they are to be accepted as representing laws of nature.</p>', '17', 1),
(92, 'Chemistry Lab', '3gdd1cpiyk4kwg0sko.jpg', '', '', '<p>The Chemistry Laboratory conducts fundamental studies of highway materials to understand both failure mechanisms and superior performance. New standard test methods are developed to improve and facilitate the chemical analysis of highway materials and to characterize and quantify new or alternative sustainable materials. The Laboratory also assists with forensic investigations of premature failures of pavements and other highways structures.</p>', '17', 1),
(41, 'Machine Tools', '4uywignacy68wgwcw.jpg', '', '', '', '6', 1),
(77, 'AC Machines Lab', '1dxoxwxwvhus00s4cc.jpg', '', '', '<p>AC Machines laboratory is designed for students to perform experiments on transformers, Inductions motors and Synchronous machines. The main objective of this laboratory is to i mpart knowledge about characteristics and behavior of the AC Machines, operation of transformers, synchronous and asynchronous machines and give them experimental skill, familiarize with the constructional details of different types, working principle and their performance.</p>\n\n<p>This lab consists of machines and all are mounted in industrial type of assembly to give the students industrial feel. Well established with all kinds of motors and variable frequency drives (VFDs). The lab has moderate machines and students are using for project and research work also.</p>\n\n<p>&nbsp;</p>\n\n<p>Facilities: Single phase transformer (12 Nos), three phase transformer (06 Nos), Induction Motors (06 Nos), three phase synchronous motor (02 Nos), Alternator Sets (04 Nos) and drives (05 Nos)</p>', '5', 1),
(90, 'Communication skills and Life skills Lab', 'f6vksyjyj400kkkogo.jpg', '', '', '<p>Communication skills and Life skills Lab<br />\nEnglish enhances the employability of students. It enriches a high-degree of proficiency in English Language. It is the language of opportunities. It enables the students to expedite the process of improving learning skills, with more emphasis on LSRW (Learning, Speaking, Reading &amp; Writing).T hese labs train the students in Language Skills, Soft Skills, Inter Personal Skills, Decision Making, Business Communication, Pre-Placement Training, Corporate Readiness, GRE etc.</p>\n\n<p>The main aim of this labs is to improve Communication Skills in formal and informal situations. It is also to impart training to students through the syllabus in its theoretical aspects and practical components.</p>', '17', 1),
(88, 'STRENGTH OF MATERIAL LAB', 'ded542twvpk4g48oo0.jpg', '3h96sfyypts0kw8gkw.jpg', '', '', '1', 1),
(89, 'TRANSPORTATION ENGINEERING LAB', 'qm0x04mzzr4wwsos8g.jpg', 'eq4uu677uqokwc88k.jpg', '', '', '1', 1),
(87, 'SOIL MECHANICS LAB', '8f59toas3pc0g4sgks.jpg', 'm82rim3f9lwwsg488c.jpg', '', '', '1', 1),
(85, 'ENVIRONMENTAL ENGINEERING LAB', 'ijdmnezg8bkgg8gcog.jpg', '', '', '', '1', 1),
(86, 'FLUID MECHANICS AND HYDRAULLIC MACHINERY LAB', 'snmkn976bj4kg0wss0.jpg', '91ra5d5snqkow8o8.jpg', '', '', '1', 1),
(82, 'CAD OF BUILDINGS LAB', '8stlhllbdq0wsckoos.jpg', '', '', '', '1', 1),
(83, 'CONCRETE TECHNOLOGY LAB', '361au78ow400wccg8s.jpg', '', '', '', '1', 1),
(84, 'ENGINEERING GEOLOGY LAB', '1z1r6xrhg9wgg4g0ws.jpg', '7z56c3amyaskkwogkg.jpg', '', '', '1', 1),
(76, 'Electrical Circuits Lab', 'lvhz34jh2dc4w04sss.jpg', '', '', '<p>The Electrical Circuits Laboratory assists the students to impart with essential knowledge of electrical and electronic circuit design and analysis and provide hands on experience to design different electrical and electronic circuits with bread boards and with different active and passive components. This Lab gives the practical learning and use of various instruments like Multimeter, Oscilloscopes, Function Generators, Wattmeter&rsquo;s etc. Along with this, they do practical verification of various electrical theorems, Tests on Transformer, measurement of power in three phase circuits using wattmeter etc. Facilities: Regulated power supply (30 Nos), Cathode ray oscilloscope (20 Nos), Function Generators (15 Nos), MATLAB and LabVIEW Software</p>', '5', 1),
(43, 'Production Technology Lab', 'pcy79acgbqsck8c4ok.jpg', 'qbh1kspr49ww8wwcs4.jpg', '', '', '6', 1),
(47, 'Laboratories', '7yhh1of5xvk0gcw8s0.jpg', 'd43xzra9zyg44ocwgg.jpg', '3f040plxuxs088soso.jpg', '<p>Laboratories:<br />\nChemistry plays a vital role in qualitative and quantitative analysis of chemicals. During the engineering chemistry lab, the students can acquire practical knowledge about estimation, preparation and instrumentation techniques. The students to apply the theoretical concepts while performing the experiments.</p>', '11', 1),
(44, 'Thermal Engineering Lab', '6k6fw4e3sqw440gso.jpg', '2bece6bht24gkwcgc4.jpg', '', '', '6', 1),
(97, 'MANUFACTURING FABRICATION PRACTICE LAB', '6s8fz69v2204cw4o48.jpg', '', '', '<p>The Manufacturing Processes (MP) Laboratory provides students with the opportunity to study and practice manufacturing processes. This laboratory provides students with experimental technique of manufacturing processes. Students can set up and operate machines, manufacture parts, measure process variables, and inspect manufactured parts. Student learning from lab experiences is integrated with prior and subsequent learning of other engineering topics such as engineering materials.</p>\n\n<p>The MP Laboratory also provides facilities for students to carry out process and product design projects in many courses. The principal research objective of the MP Lab is to provide opportunities to study selected manufacturing processes. To date, the lab equipment has been used for studies in machining. The machine tools have also been used to fabricate pieces of equipment for experiments.</p>', '16', 1),
(45, 'Workshop Practice Lab', '2awgcpzj9ijogkc8w8.jpg', '9bd2dqra7ew4cog0o.jpg', '', '', '6', 1),
(46, 'Labs', '', '', '', '<p><strong><span style=\"color:#FF0000\">ENGLISH LANGUAGE COMMUNICATION SKILLS LAB</span></strong></p>\n\n<p>English Language Communication Skills Laboratory (ELCS) plays a significant role in enhancing the skills of engineering students. The infrastructural facilities provided, in addition to the teacher resources to enhance the skills among the students at the foundation level of engineering first year sure to prepare them compatible for &lsquo;industry ready&rsquo;. The ELCS Labs help the budding professionals to acquire relevant language skills effectively and certain measures are required to be taken by the university authorities to highlight the use and importance of the ELCS Labs for forthcoming times.</p>\n\n<p>The use of effective communication is an outcome of the language labs. Proficiency is of course, the matter of constant practice, endeavour and effort. In terms of global scenario &ldquo;Engineering English&rdquo; has been growing its prominence everywhere and the professional students of science and technology need to acquire these skills according to the global demands of the present century.<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\n\n<p><span style=\"color:#FF0000\"><strong>ADVANCED COMMUNICATION SKILLS LAB</strong></span></p>\n\n<p>Advanced Communication Skills Lab is considered essential at 3&Prime; year level. At this stage, the students need to prepare themselves for their careers, which may require them to listen to, read, speak and write in English both for their professional and interpersonal communication in the globalised context. Advanced Communication Skills lab to enable students to use &lsquo;good&rsquo; English and perform the following: Gathering ideas and information to organize ideas relevantly and coherently, Engaging in debate, Participating in group discussion, Facing interviews, Writing project/research reports/technical reports.</p>\n\n<p>&bull; Making oral presentations.</p>\n\n<p>&bull; Writing formal letters.</p>\n\n<p>&bull; Transferring information from non-verbal to verbal texts and vice-versa.</p>\n\n<p>&bull; Taking part in social and professional communication.</p>\n\n<p>&bull; Further, they would be required to communicate their ideas relevantly and coherently in writing.</p>\n\n<p>&bull; To prepare all the students for their placements.</p>\n\n<p>&nbsp;</p>', '9', 1),
(96, 'HYDRAULICS AND PNEUMATICS LAB', 'tdeb3zmym5w8sks4s.jpg', '', '', '<p>Hydraulics lab is generally provided with water flow measuring equipment, turbines, pumps etc. these equipment help in determining rate of flow, velocity, flow characteristics, coefficients etc.</p>\n\n<p>Pneumatics are the machines which runs atmospheric air. The air is used as a work substance. The lab includes a range of different valves and regulators to familiarize students with the type of motions that can be achieved by pneumatic devices. It contains flow control valves, directional control valves etc.By using this valves and air has a working medium to motion of air cylinder are controlled. The air first compressed in compressor and then supplied to different valves and actuators and finally control of air cylinder.</p>', '16', 1),
(106, 'CAD/CAM LAB', 'qiea54abb7k0w840ow.jpg', '', '', '<p>It is a computer aided designing and drafting software application. A well-equipped computer lab with advanced facilities is established for the benefits of civil engineering students. High end terminals supported by latest hardware and software, latest visual aids, plotting devices etc. are among them. Advanced civil engineering software are procured for making the students globally competitive and industry ready. At CAD lab, students get professional training on 2D and 3D drafting of civil engineering drawings using the latest version of auto CAD drawings.</p>\n\n<p>&nbsp;</p>', '16', 1),
(107, 'THERMAL ENGINEERING AND REFRIGERATION AND AIR CONDITIONING LAB', '16wcimr4dp34wg04ss.jpg', '', '', '<p>In this laboratory, students will have the opportunity to study the working principle of IC engines (both SI and CI engines), performance and characteristics in terms of heat balancing, economical speed variations, air fuel ratio influence on the engine to reinforce classroom theory by having the student perform required tests, analyze subsequent data, and present the results in a professionally prepared report.</p>\n\n<p>The machines and equipment used to determine experimental data include cut models of 4stroke diesel engine, 2stroke petrol engine, 4stroke and two stroke petrol engines with required specifications, Multi cylinder SI engine, Single cylinder Diesel engine for performance and speed test which is suitable to tests on variable compression ratios.</p>\n\n<p>&nbsp;</p>', '16', 1),
(108, 'FUELS LAB', '21ozhs7lft1c400os8.jpg', '', '', '<p>The main objective of this lab is to develop an idea of fuel properties and their variation with temperature, determination of kinematic viscosity and calorific value of fuels.</p>\n\n<p>&nbsp;</p>', '16', 1),
(109, 'SURVEYING LAB', 'ke93rebu59w8cgw40s.jpg', 'csnometuqmo8g0gkg0.png', 'j14f4dhwa3kg84kwos.jpg', '<p>Surveying is very important in civil engineering discipline. It is the basic knowledge to create a path to construct a building, highway, dam, reservoirs and any other structures. Based upon the data availability from surveying only, we can go forward. By this we get a clear view on heights, distances, areas and volumes in linear and angular measurements. In addition of advanced techniques in surveying, GPS &amp; GIS is provided. It is an important subject to apply our views in field.</p>\n\n<p>&nbsp;</p>', '13', 1),
(110, 'ENGINEERING DRAWING HALL', 'kj395nul55ww8wk8g8.jpg', '', '', '<p>Drawing is said to be the language of engineers. All material objects have a shape and form, which can be represented by a combination of known geometrical figures. A thorough grounding in drawing to represent these objects on a plane is considered very essential for engineers. Any construction or fabrication, it may be a building, a factory or a machine has to begin with a drawing which forms the basis and guide to get the work done.</p>\n\n<p>Drawing is commonly used mode of communication in the engineering industry. Proper exposure to drawing helps the students to translate different ideas into practice. Acquisition of skill will produce a drawing to represent a given object with sufficient knowledge to understand and interpret. As such drawing is regarded a pre-requisite for technician engineer.</p>', '16', 1),
(111, 'Electrical Machines Lab', 'nfnfb2490rkg8sgcg8.png', '', '', '<p>This Laboratory activities supplement the theory with suitable practical experiments. Students will prove some theories, examine the machine&rsquo;s characteristics using approximate analytical methods. It is designed to practically implement and observe the characteristics of Transformers, Generators, Motors and their applications. Machines used in the experiments are the AC synchronous machine, AC induction machine, DC series machine and DC shunt machine whereby they will function as motors and generators. Observations and data taken during the experiments are used to produce a report</p>', '15', 1),
(112, 'Electrical Circuits Lab', '2wv2lm8h8cysss4804.png', '', '', '<p>In the Electrical Circuit Lab students can create their own electrical circuits and do measurements on it. In the circuits the students can use resistors, light bulbs, switches, capacitors and coils. The circuits can be powered by an AC/DC power supply or batteries. There is an ammeter, voltmeter, wattmeter and an ohmmeter. Students can analyze the collected data by creating graphs of the data and use the graphs in the conclusion tool.</p>', '15', 1),
(113, 'MATERIAL TESTING& CONSTRUCTION PRACTICE LAB', '3463tuew4jwg4wwsko.jpg', '26tr2uk1ljhckkc0c8.jpg', '34ycrv15vracoo8w4w.jpg', '<p>MT&amp; CT Practice lab is essential for civil engineering students because in most of the civil engineering works are related to construction field. We are using different materials in construction like bricks, cement, sand, coarse aggregate and metals. So we have to know the characteristics of each and every material like strength, durability and water absorption etc. and find out performance of materials.</p>\n\n<p>&nbsp;</p>', '13', 1),
(114, 'Electrical Measurements Lab', '46v91y6sq4ys8ow04.png', '', '', '<p>In Electrical Measurements Lab students can learn the correct function of electrical parameters and calibration of voltage, current, single phase and three phase power and energy, and measurement of electrical characteristics of resistance, inductance and capacitance of circuits through appropriate methods and understand testing of transformer oil.</p>', '15', 1),
(115, 'HYDRAULICS LAB', '3cfl9dn0tgsgw84o4c.jpg', 'm0gyq1kmmn4g8go4gc.jpg', '', '<p>Hydraulics lab is generally provided with water flow measuring equipment, turbines, pumps etc. these equipment help in determining rate of flow, velocity, flow characteristics, coefficients etc. All these data help in designing perfect water canals, sewage pipes etc. in real time. Turbines and provides the knowledge of converting mechanical to hydraulic and hydraulic to mechanical energies. Their speeds, pressure details help in construction of hydro power plants.</p>', '13', 1),
(116, 'CIVIL ENGINEERING WORKSHOP LAB', '', '', '', '<p>The Civil Engineering workshop practice lab provides hands on experience about the use of different engineering materials, tools, equipments and processes that are common in engineering field. The workshop lab equipped with various latest tools and instruments. It imparts basic knowledge of various tools and their use in different sections of manufacture. Each and every civil engineering work can be accomplished only through this lab. This lab helps to understand and familiarize you about erection of scaffolding and fixing of formwork, bending of bars as per drawings, plastering of a wall, and plumbing.</p>', '13', 1),
(117, 'Power Electronics Lab', 'woxpwrcjvqscg4k8oc.jpg', '', '', '<p>The power electronics lab enhances the EEE students by providing them the better understanding of the concepts and working of advanced power semiconductor devices and power electronics. Power Electronics Lab is an ideal platform to enhance education, training, skills &amp; development among our young minds. Students can perform experiments like VI characteristics of the power electronic devices, single phase controlled rectifiers, DC-DC choppers etc. This Lab is provided with a bread board for testing their own circuits.</p>', '15', 1),
(118, 'Electrical CAD & PLC Lab', '1e18xodfhy68wwwk80.jpg', '', '', '<p>Electrical Computer-Aided Design (ECAD) software is used to create and modify both diagrams and layouts, i ncluding both 2D and 3D, in order to design, assess and document electrical Printed Circuit Boards (PCB). In the field of electrical engineering, the layouts of power distribution system are prepared. In all fields of engineering use of computer is made for drawing and drafting. The PLC lab contains multiple workstations equipped with computers, PLC units and other interfacing devices to train students how to program and upload ladder logic code. Students program ladder logic code using the RSLogix software, which provides a graphical interface representing conditional computer programming functions such as if/else statements. The lab is based primarily on the Allen Bradley family of Programmable Logic Controllers, which are widely used in factories and other settings.</p>', '15', 1),
(119, 'AUTO CAD LAB', '1en0ur4kk280wks0oc.jpg', '892kfttuwzs4g8ccco.jpg', '5k2sxnzifqg4co0ws.jpg', '<p>It is a computer aided designing and drafting software application. A well-equipped computer lab with advanced facilities is established for the benefits of civil engineering students. High end terminals supported by latest hardware and software, latest visual aids, plotting devices etc. are among them. Advanced civil engineering software is procured for making the students globally competitive and industry ready. At CAD lab, students get professional training on 2D and 3D drafting of civil engineering drawings using the latest version of auto CAD drawings. Students will learn computer aided design layout and 3D modeling definition. Students will also gain the knowledge of design and drafting needed for civil engineering discipline. This lab also includes different software like MEP which enhances the overall design and modeling process. 4M IDEA software is used for 2D and 3D architectural design, rendering and animation. Primavera p6 software is used for planning monitoring, controlling and reporting a project.</p>\n\n<p>&nbsp;</p>', '13', 1),
(120, 'Electrical Workshop Practice lab', '4snnsy3xrpc0w8s80.jpg', '', '', '<p>The electrical workshop practice lab provides hands on experience about the use of different engineering materials, tools, equipments and processes that are common in engineering field. The workshop lab equipped with various latest tools and instruments. It imparts basic knowledge of various tools and their use in different sections of manufacture such as Soldering etc.</p>', '15', 1),
(124, 'DATA STRUCTURES LAB', '5pewh9e8oskkoosko8.jpeg', '', '', '', '22', 1),
(125, 'DATA BASE MANAGEMENT SYSTEM LAB', 'f0chxm8f6i8skc448s.jpeg', '', '', '', '22', 1);
INSERT INTO `dep_mous` (`sno`, `department`, `title`, `image`, `description`, `status`) VALUES
(1, '1', 'TELANGANA ACADEMY FOR SKILLS AND KNOWLEDGE (TASK)', 'jd5g9m9d02ogwk4os.jpg', '<p>Telangana Academy for Skills and Knowledge was established by the Government of Telangana to enable a platform between Government, Academia and Industry to enhance employability quotient of students in the state.</p>\n\n<p>Vaageswari college of Engineering has MoU with Telangana Academy for Skill and Knowledge. This promotes to support for conducting workshops, internships &amp; training programs to enhance student&rsquo;s technical skills. Thus, improving the success rate of employability?</p>\n\n<p>&nbsp;</p>', 1),
(2, '5', 'MOU\'S', 's2dxxbfheg0kco0sg4.jpg', '<p>Mou&#39;s<br />\nTASK Telangana Academy for Skills and Knowledge was established by the Government of Telangana to enable a platform between Government, Academia and Industry to enhance employability quotient of students in the state.</p>\n\n<p>Vaageswari college of Engineering has MoU with Telangana Academy for Skill and Knowledge. This promotes to support for conducting workshops, internships &amp; training programs to enhance student&rsquo;s technical skills. Thus, improving the success rate of employability.</p>\n\n<p>ICT academy<br />\n&nbsp;</p>\n\n<p>* ICT ACADEMY INSTITUTIONAL MEMBERSHIP<br />\n&nbsp;</p>\n\n<p>* Benefits:<br />\n* Faculty Development programmes Training Programs Skill Development</p>\n\n<p>* Initiatives Research Industry - Institute Interaction Nurturing Innovation</p>\n\n<p>ABHINAV TECHNOLOGIES<br />\nTrained by MATLAB</p>', 1),
(13, '1', 'KG MECH', 'lx1qx6z0oe80o8cgsw.jpg', '<p>Benefits:</p>\n\n<p>Nurturing Innovation</p>\n\n<p>Research</p>\n\n<p>Training Programs</p>', 1),
