(14, 'Ajit Kumar', 'ajitkumarch183@gmail.com', 'Invitation from your Chamber of Commerce\r\n\r\nYou are cordially invited to participate in our India Community Hub Online Mixer hosted by the Chamber of Commerce.\r\n\r\nThis is an important event for any senior executive looking to expand their business, access new capital and/or acquire new customers.\r\n\r\nDate: Friday, 25th February 2022.\r\n\r\nTime: 2:30pm - 3:30pm (India Time)\r\n\r\nFormat: Online -- Free to attend.\r\n\r\nRegistration & Event Link: https://bit.ly/3oVgKuO\r\n\r\nThe India Online Community Hub is designed to facilitate peer-to-peer sharing between senior business executives in a trusted and confidential environment.  By drawing from the expertise and experience of other business executives, the format encourages ways to navigate the needs of your business, and community engagement to help members achieve success in import, export and international trade in products and/or services. \r\nYou will learn about free tools to help you find venture capital, participate in national and international government tenders, locate national and international buyers of products and services and meet with other C-level executives. \r\n\r\nThis event is the first of many such free events and will also focuse on key areas of development: \r\n- Business Improvement\r\n- Export Market Development\r\n- Trade Compliance\r\n- Business Leadership\r\n- Personal and Professional Growth\r\n- Peer-to-Peer Mentoring\r\n- Connections and Friendship\r\n\r\nSenior executives from across India participate in these events - there is zero cost to attend and you can participate online.\r\n\r\n\r\nUnsubscribe - Go here if you never want to hear from us again: https://bit.ly/3HY2cSz', '2022-02-17 23:30:56', 1),
(15, 'Ajit Kumar', 'ajitkumarch183@gmail.com', 'Hello\r\n\r\nJust a quick reminder that next week, Friday 25th Feb, the Trade Council will be holding an online virtual event for CEOs from some of the largest companies in India and we\'d love to see you attend.\r\n\r\nDate: Friday, 25th February 2022.\r\nTime: 2:30pm - 3:30pm (India Time)\r\nFormat: Online -- Free to attend.\r\nRegistration & Event Link: https://www.runtheworld.today/app/invitation/40542\r\n\r\nAttendance is limited so please register early.  (If you already registered please disregard this message) \r\n\r\nThe purpose of the event is to focus on problems and solutions to challenges related to acquiring and retaining customers, expanding into new markets, trade and supply chain and other things pertaining to international trade in products and services. \r\n\r\nThere\'s a virtual mixer event as well with speed-dating and the program is part of our ongoing series of mixed in-person and virtual meetups across the country (together with our regional chairpersons / chapters in each city).\r\n\r\nWe\'d love for your CEO  / C-Level executives to attend and can promise that it will be a valuable experience. \r\n\r\nYou can learn more about the ITC here: https://bit.ly/3BorfM5\r\n\r\nIf you\'d prefer we never contacted you again you can Opt-Out here: https://bit.ly/3HY2cSz', '2022-02-19 13:44:59', 1),
