INSERT INTO `testimonials` (`sno`, `testimonial`, `name`, `role`, `company`, `t_image`, `status`) VALUES
(1, '<p>Vaageswari College of engineering provided me requisite knowledge and skills to adapt to the corporate life. It is indeed a good feeling to get placement through the Campus as it boosts ones moral and self &ndash;esteem. Thanks &ndash; Placement Department for providing me the right job and profile that I was looking for.</p>', 'Sonu Singh', 'Student', '1', '260vzk5iobdw8g8kck.png', 1),
(2, '<p>My sincere appreciation &amp; gratitude to the Training &amp; Placement Department and all staffs of Vaageswari College of Engineering for their efforts in imparting quality technical and aptitude training. I am very grateful to them for effectively and sincerely helping me to grab first ever opportunity that came into my life.&rdquo;</p>', 'Shalini Ojha', 'Student', '1', '9a556mriz5cssok0c0.png', 1);
